(362, 'BABEL Sistemas de Información', 'info@babelgroup.com', 'https://www.infojobs.net/sevilla/programadores-php/of-if0e418443f46d6bc5b819775ae2263?applicationOrigin=search-new&amp;page=1&amp;sortBy=RELEVANCE', 'BABEL es una empresa internacional que presta servicios tecnológicos orientados a acompañar a grandes organizaciones en su proceso de Transformación Digital.\r\n\r\nEstamos buscando reforzar nuestro equipo de programadores de Software con un nuevo compañer@, que nos ayude a llegar a Marte 2025.\r\n\r\n¿Qué es Marte 2025?\r\n\r\n¡Es nuestro objetivo! Llegar a 5000 babelianos en el mundo, es el reto que tenemos por delante, y por ello, reforzando nuestro equipo, estamos seguros que el camino se hará más fácil.\r\n\r\n', 1, '2022-01-27 18:51:17'),
