(365, 'Arestes', 'seleccion@arestes.es', 'https://www.infojobs.net/barcelona/php-developer/of-i29343a58cc4047a7359272f14fe302?applicationOrigin=search-new&amp;page=2&amp;sortBy=RELEVANCE', 'Required skills:\r\n- Minimum of 5 years experience in PHP development.\r\n- Laravel PHP framework.\r\n- Coding best practice.\r\n- Very comfortable with RESTful API and SQL.\r\n- Knowledge of SOLID principles and Domain-Driven Design.\r\n- Unit and functional testing.\r\n- Redis cache system.\r\n- Javascript / AJAX / CSS.\r\n- XML / JSON formats.\r\n- Github.\r\n- Linux / Windows.\r\n- Technical English read and written.\r\n\r\nNice to have:\r\n- JIRA and SCRUM.\r\n- Jenkins.\r\n- Docker.', 1, '2022-01-27 19:19:44'),
(366, 'New Tandem', 'newtandem@newtandem.com', 'https://www.infojobs.net/madrid/backend-senior-developer-php/of-ic9ca2ed511413da7b1b96a6c7ed9f2?applicationOrigin=search-new&amp;page=2&amp;sortBy=RELEVANCE', 'Upper Grade Educational Cycle or technical degree that involves programming.\r\n* PHP knowledge and automated testing experience\r\n* At least 4 or 5 years of experience with frameworks like Yii, Laravel or Symphony\r\n* Experience building and/or integrating APIs (RestFul and/or GraphQL)\r\n* Database management: PostgreSQL or MySQL\r\n* At least 2 years of experience with Javascript\r\n* Angular experience is a Plus\r\n* GIT version control\r\n* Proactive, accountable, flexible, analytical, pragmatic\r\n* Experience managing teams\r\n* High motivation to learn and grow\r\n\r\nB2-C1 level of English (used daily in the company)', 1, '2022-01-27 19:22:30'),
(367, 'Afterbanks', 'info@afterbanks.com', 'https://www.infojobs.net/afterbanks/em-i98565453535048771111145014126179603751', 'PHP (y/o Java), SQL, Git. Nuestro proceso incluye una prueba técnica.\r\nDeseable: Herramientas de gestión de APIS, tests, calidad de código, tecnologías Cloud, flujos CI, Linux, MacOS, VSCode, lenguajes y frameworks de front, o móvil, como Ionic.\r\nLa experiencia que nos gustaría que tuvieras\r\n\r\nExperiencia mínima de 4 años como programador y al menos 3 años programando en PHP.\r\nAl menos 6 meses de experiencia programando con SQL, Shell Scripts y Linux (en función del tipo y duración de los proyectos en que hayas participado).\r\nValoramos mucho la experiencia en integración de APIs, y flexibilidad a la hora de trabajar tanto con frameworks de PHP, como con PHP puro.\r\nOtras capacidades importantes', 1, '2022-01-27 19:24:36'),
(368, 'Nuclio Digital School', 'talent@nuclio.school', 'https://www.domestika.org/es/jobs/91570-webmaster-barcelona-espana', '- Grado medio en Sistemas Microinformáticos y Redes.\r\n- Apasionado por las tecnologías, con ganas de aprender y autónomo.\r\n- Conocimiento medios en tecnologías front-end (HTML, CSS y Javascript).\r\n- Conocimientos alto/avanzado de Wordpress.\r\n- Conocimientos básicos de Diseño y SEO.', 1, '2022-01-27 19:51:34'),
(369, 'Parafina Comunicación', 'rrhh@parafina.es', 'https://www.domestika.org/es/jobs/91581-desarrollador-a-front-end-madrid-espana', '- Configuración pasarelas de pago, integración mensajerias, automatización emails, posible integración con ERPS, etc.\r\n- Maquetación orientada al SEO.\r\n- Conocimientos avanzados HTML, CSS y PHP.\r\n- Gestión de bases de datos MySQL.\r\n- Conocimientos de Marketing online.\r\n- Conocimientos de UX y metodología Agile.\r\n- Email marketing.\r\n- Capacidad para desarrollar y modificar plugins, gestión de servidores, posible desarrollo de módulos…).\r\n- Conocimientos Mac Os', 1, '2022-01-27 19:52:48'),
(370, 'GETECSA', 'contacto@getecsa.co', 'https://mx.indeed.com/viewjob?jk=6150f12e6eb9a868&amp;tk=1fqgo6l29t5lh800&amp;from=serp&amp;vjs=3', '¿Quiénes somos?\r\n\r\nGETECSA es una empresa joven con la visión clara de lograr solidez y reconocimiento a nivel Latinoamérica como una de las mejores compañías en servicios de tecnologías de la información y comunicaciones.\r\n\r\nEn Getecsa tenemos como objetivo principal ofrecer servicios con un alto sentido de calidad de tal manera que nuestros socios comerciales puedan alcanzar sus objetivos de forma ágil y con calidad a fin de que estén altamente satisfechos con nuestro apoyo.\r\n\r\n\r\n\r\nCandidatura\r\n\r\nActualmente estamos buscando un \"Desarrollador PHP-Laravel Sr” para laborar con uno de nuestros principales clientes.\r\n\r\nRequisitos:\r\n\r\nLicenciatura en sistemas computacionales o afín.\r\nDesarrollo de aplicaciones y funciones.\r\nCrear código eficiente.\r\nTrabajar de la mano de Laravel con PHP.\r\n\r\nExperiencia:\r\nHaber trabajado con metodología Scrum.\r\nPHP a un nivel avanzado.\r\nLaravel (avanzado).\r\nGIT o SVN.\r\n\r\nOfrecemos:\r\nPrestaciones de ley y esquema de trabajo 100% remoto.\r\nSeguimiento a los procesos.\r\nClaridad y honestidad en los procesos.\r\nAmabilidad y empatía.\r\n\r\n¡Únete a GETECSA!\r\nGetecsa\r\nhace 30+ días', 1, '2022-01-28 16:30:09'),
