(390, 'PeopleGo', 'cristianariztia@peoplego.cl', 'https://peoplego.cl/proyectos/?gclid=Cj0KCQiAxc6PBhCEARIsAH8Hff2dgngwm99rfVWJdVI18BLUvZv6n1Uos8zUwWuegFM5pQqTbsa_x0saAmE1EALw_wcB', 'Gestionamos tu proceso de reclutamiento por medio de variadas herramientas para responder óptimamente el requerimiento. A través de filtro curricular y streaming telefónico, con la finalidad de realizar un trabajo asertivo y especifico ante el perfil solicitado.', 1, '2022-01-28 18:41:08'),
