(395, 'Aha!', 'support@aha.io', 'https://www.weremoto.com/job-posts/id-sr-platform-engineer-aha', 'Our web application is a single-instance, multi-tenant Ruby on Rails monolith supported by Postgres (database), Redis (background jobs), memcached (Rails caching), and Kafka. We also run a Node.js webserver to support collaborative editing and real-time updates. Our application is hosted on Amazon Web Services and architected with ECS for reproducibility and scalability.\r\n\r\nWe embrace new technologies that help us deliver a lovable product, but we also remain cognizant of the maintenance overhead that a new library or platform brings. We solve the problems in front of us rather than prematurely optimizing to address issues that may never materialize. That said, some of the largest companies in the world store a large amount of their precious strategic data in Aha!, so we do plenty of optimizing too.', 1, '2022-01-28 19:27:41'),
(396, 'Finale Inventory', 'chinh@finaleinventory.com', 'https://www.weremoto.com/job-posts/id-senior-software-engineer-javascript-node-react-finale-inventory', 'The major components of our technology stack are Node.js, React, MySQL, Redis, Linux, and AWS. Our JavaScript code uses modern idioms such as functional reactive programming. We also use C++ compiled to WebAssembly and also compiled as a native Node.js module for performance critical code. We use GitHub, Slack, Zoom, and Monday.com for collaboration. We do NOT use Jira.', 1, '2022-01-28 19:40:02'),
(397, 'cloudforecast.io.', 'hello@cloudforecast.io', 'https://www.weremoto.com/job-posts/id-senior-full-stack-software-engineer-cloudforecast', '7-10+ years of full-stack software development experience \r\nExperience and interest in working on a SaaS app \r\nStrong experience and proficiency in Ruby on Rails \r\nKnowledgeable in JavaScript framework’s (ReactJS ideally) \r\nComfortable building full-stack features from scratch \r\nStrong verbal and written English communication skills \r\nOrganized, flexible, and adaptable in an extremely fast-paced tech startup environment. \r\nEmpathy towards users\' feedback and problems. ', 1, '2022-01-28 19:43:06'),
