(399, 'tracmediaservices', 'denise@tracmedia.com', 'https://www.weremoto.com/job-posts/id-junior-developer-trac-media-services', 'Preferred Qualifications:\r\nWorking knowledge of Git\r\nExperience with unit and integration testing\r\nExperience with: HTML, CSS, Javascript, C#, F#, and/or SQL\r\nExperience with cloud computing, PAAS, SOA, especially Microsoft Azure', 1, '2022-01-28 19:57:40'),
(400, 'Bellroy', 'support@bellroy.com', 'https://www.weremoto.com/job-posts/id-developer-haskell-bellroy', 'Have at least 2-3 years experience with Haskell and functional programming\r\nStrive to deliver high quality code with strong, well-researched design principles\r\nPrefer mastering your craft over managing people (for now, but you’re welcome to change your mind about that in the future)\r\nWant to join a highly competent technical team, supporting and supported by world-class professionals in product design, data science, logistics, production, sales, finance and customer support\r\nDon’t work just to pay the bills, but also because you’re passionate about contributing to the team and the open source community\r\nGet excited about great ideas, wherever they come from – books, blogs and podcasts, technical and non-technical\r\nWant to work for a company that cares about doing good things for the world', 1, '2022-01-28 20:03:42'),
(401, 'Studio Hakuna', 'hello@studiohakuna.com', 'https://www.weremoto.com/job-posts/id-sr-full-stack-developer-python-y-django-studio-hakuna', 'Experiencia de más de 4 años desarrollando Python y Django (excluyente).\r\nExperiencia en desarrollo FRONT END tanto en Desktop como Mobile (excluyente)\r\nExperiencia en desarrollo de Productos (excluyente)\r\nExperiencia trabajando con metodologías ágiles.\r\nEs un plus contar con  experiencia en Base de Datos, plataforma AZURE y en ANALYTICS.\r\nSe valorará un nivel intermedio de inglés.', 1, '2022-01-28 20:07:27'),
(402, 'Development Seed', 'info@developmentseed.org', 'https://www.weremoto.com/job-posts/id-technical-communications-lead-development-seed', 'You have experience regularly producing data-driven communications products—perhaps as a journalist, data scientist, information designer, technical writer, or communications professional. You are familiar with earthdata and geospatial data and tools OR have the ability to quickly develop a working understanding of earthdata tools and concepts through self-guided research.\r\n\r\nYou are creative and enjoy storytelling in all its forms - oral, visual, written, and digital. To be successful in this role you need to know where the story is.\r\n\r\nBonus points for sharing: \r\nA story that you’ve published (self-published is fine) that leverages complex data and maps.\r\nHow you’ve driven a positive outcome on behalf of an organization or endeavor through thoughtful, strategic communications.\r\n', 1, '2022-01-28 20:14:38'),
(403, 'Instinct Science', 'sayhi@instinct.vet', 'https://www.weremoto.com/job-posts/id-front-end-react-engineer-instinct-science', '* Typescript, HTML, CSS, React, Apollo, Electron\r\n* Jest, React Testing Library\r\n* Elixir, Phoenix, Absinthe, Docker\r\n* Node\r\n* PostgreSQL, Redis\r\n* AWS, CircleCI, Github Actions\r\n* Papertrail, Sentry\r\n* Github, Jira, Slack', 1, '2022-01-28 20:18:20'),
(404, 'Grupo Santy', 'info@gruposanty.com', 'https://www.infojobs.net/movilidad-internacional/programador-informatico/of-i6565f07510400b8c5215d177e3b59b?applicationOrigin=search-new&amp;page=1&amp;sortBy=RELEVANCE', 'En Grupo Santy, buscamos personas que desarrollará entre entre otras, las siguientes funciones:\r\n-Desarrollo de nuevos programas y mantener los existentes.\r\n-Administración y mantenimiento de equipos Windows.\r\n-Programación JAVASCRIPT, HTML, PHP, JAVA, JSEE.\r\n-Administración de servidores y equipos existentes.', 1, '2022-01-28 20:37:44'),
(405, 'billwerk', 'hello@billwerk.io', 'https://landing.jobs/at/5443/mid-level-software-developer-m-f-d-in-gdansk?country=PL', 'your commercial programming experience is at least 2 years\r\nyou have good programming experience is with C#/.NET\r\nyou have knowledge in HTML5, JavaScript, Asp.Net, Angular, Bootstrap. No-SQL is a big plus\r\nknowledge of principles: DRY, KISS, SOLID\r\nyou are curious person and open to learning new approaches every day and can’t wait to put your ideas into action\r\nyou have strong analytical skills and you love to solve tricky tasks\r\ngood knowledge of English at least B1 level\r\nhigh quality awareness is a matter of course ', 1, '2022-01-28 21:01:08'),
(406, 'FCT - FCCN', 'secretaria@fccn.pt', 'https://landing.jobs/at/fct-fccn/devops-engineer-in-lisbon-2022?country=PT', '  Docker\r\n  Java J2EE, Java Server Pages, Java Beans\r\n  Python\r\n  TomCat\r\n  Maven / Ant\r\n  Linux Servers\r\n  Apache HTTPd\r\nKnowledge about architecture, development and operation of distributed computer systems;\r\nGood level of English.\r\n', 1, '2022-01-28 21:05:34'),
(407, 'Cartloop', 'hello@cartloop.io', 'https://www.linkedin.com/company/cartloop/', 'Previous experience working as Frontend Engineer/Developer for at least 4 years.\r\nSolid experience writing modern JavaScript, Typescript (ES6+).\r\nProficient with React.\r\nAttention to the details when implementing UI mockups made by our amazing design team.\r\nStrong UX focus and an interest in developing great products.\r\nExperience with building responsive, performant websites and products.\r\nExperience using modern web development tooling and command-line interfaces (Git, npm, etc.)\r\nOwnership of your work and the ability to manage deadlines as you are working remotely.', 1, '2022-01-30 19:40:44'),
(408, 'OnFrontiers', 'hello@onfrontiers.com', 'https://www.linkedin.com/jobs/view/2875921508/?alternateChannel=search&amp;refId=%2B5dQSDIcbaBn%2FI2JKfGb6g%3D%3D&amp;trackingId=VRxAcdiYdnPyjXzmE7uI9Q%3D%3D', 'Outstanding front-end professional development experience.\r\nThoughtful software engineering practices: all kinds of testing, PR reviews, pair programming, SOLID principles\r\nSensibility and appreciation for appealing and responsive visual designs that perform at scale.\r\nExperience with Component Driven Development.\r\nFluent communication in English reading, writing, and speaking\r\nSolid expertise in React or Vue.JS (3-10 years experience)\r\nDeep understanding of Typescript or similar reactive libraries.\r\nProfessional experience developing SaaS products and marketplaces', 1, '2022-01-30 19:49:41'),
(409, 'Pocket Worlds', 'contact@pocketworlds.com', 'https://www.linkedin.com/jobs/view/2869826313/?alternateChannel=search&amp;refId=%2B5dQSDIcbaBn%2FI2JKfGb6g%3D%3D&amp;trackingId=2OoIG4Hf95Dhc8t%2BQVoVJA%3D%3D', 'Take ownership for the challenges we\'ve set\r\nHave significant input in the roadmap for the web presence of Highrise\r\nTranslate concepts into mockups and convert them into intuitive player experiences\r\nWork closely with the back-end team to share requirements and identify potential issues\r\nCollaborate with the product manager and software engineers to gather and evaluate requirements\r\nTo be successful in this role, we\'d expect you to...\r\nHave 5+ years of experience as a Frontend Developer\r\nHave experience with modern Javascript/TypeScript (ES6+) development and have good knowledge of React library\r\nProfessional experience with technologies such as Redux, State Management, Graphql, Storybook, Styled-Components\r\nDeep understanding of the web platform (http, caching, cookies, assets loading)\r\nIdeally, have some startup experience with the ability to work autonomously\r\nBe able to work well in a remote development environment\r\nBe able to communicate in English at a native speaking and writing level\r\nBe responsible to your fellow remote team members\r\nBe highly communicative and go out of your way to contribute to the team and help others\r\nBonus for API, backend or infrastructure experience, an understanding of the basic mechanics of blockchain applications', 1, '2022-01-30 20:25:05'),
(410, 'ASP Consulting - Empresa de Tecnología', 'ventas@asptg.com', 'https://www.linkedin.com/jobs/view/2887074389/?alternateChannel=search&amp;refId=%2B5dQSDIcbaBn%2FI2JKfGb6g%3D%3D&amp;trackingId=jATAd6AGDft8US8MqVPKrg%3D%3D', 'Conocimiento en Lenguaje de programación (C#.net)\r\nConocimiento en diseño y modelamiento de datos.\r\nConocimiento en base de datos (SQL server 2012 osuperior).\r\nConocimiento de Github.\r\nConocimiento de Microservicios MVC.\r\nExperiencia en desarrollo de integraciones de sitemas,uso de API REST/JSON.', 1, '2022-01-30 20:29:08'),
(411, 'Underwaterpistol (UWP)', 'info@underwaterpistol.com', 'https://www.linkedin.com/jobs/view/2883709803/?alternateChannel=search&amp;refId=0DRAwJaFi%2FZ%2FsVgMn%2BmL8A%3D%3D&amp;trackingId=HYWYfS3L63cKGaVjNgyTiA%3D%3D', 'Proficiency with HTML5, CSS3\r\nExperience with Liquid\r\nGood understanding of server-side CSS pre-processing platforms, such as LESS and SASS\r\nProficient in written and spoken English\r\nProficient experience in Vanilla JavaScript\r\nProficient understanding of cross-browser compatibility issues and ways to work around them\r\nProficient understanding of code versioning tools, such as Git/Mercurial/SVN\r\nGood understanding of SEO principles\r\nA good eye for design\r\nGreat attention to detail\r\nGood verbal and written communication skills\r\nA strong understanding of UX design\r\nA portfolio of live projects\r\n', 1, '2022-01-31 19:49:35'),
