INSERT INTO `proyectos` (`id`, `user_id`, `categoria_id`, `nombre`, `link_proyecto`, `poster_img`, `url_clean`, `pequeña_descripcion`, `descripcion`, `fecha_inicio_proyecto`, `fecha_fin_proyecto`, `created_at`) VALUES
(3, 1, 4, 'the best diet', 'https://the-bestdiet.com', 'uploads/proyectos/the-best-diet6185e06026bb7-700.png', 'the-best-diet', 'Este es un proyecto que tiene como objetivo principal ofrecer productos para la reduccion de peso', '                                        <p>Este es un proyecto que tiene como objetivo principal ofrecer productos para la reducción de peso y nutrición en general.</p><p>Participe en este proyecto como desarrollador y programador de algunos módulos en los que se muestran los resultados obtenidos por algunas personas que consumían el producto.</p><p>Las tecnologías empleadas en este proyecto fueron:</p><ul><li>HTML</li><li>CSS</li><li>JavaScript</li><li>PHP</li></ul>                                        ', '2021-05-01 06:00:00', '2021-10-16 06:00:00', '2021-11-05 17:06:14'),
(4, 1, 2, 'PinaLok', 'https://pinalok.vercel.app', 'uploads/proyectos/pinalok6185e43f09abf-700.png', 'pinalok', 'PiñaLok es una empresa que se encarga de crear bebidas fuera de lo común, se especializan en las piñas coladas', '                                                            <p>PiñaLok es una empresa que se encarga de crear bebidas fuera de lo común, se especializan en las piñas coladas, es una empresa en pleno crecimiento que aposto por el mercado de las bebidas exóticas y pretende conquistar el mercado posicionándose como la mejor bebida que probaras.</p><p>Participe en este proyecto como diseñador y desarrollador de la página,  contando con diseñadores profesionales que me aportaban el contenido.</p><p>Las tecnologías empleadas en esta página fueron:</p><ul><li>HTML</li><li>CSS</li><li>JavaScript</li><li>SCSS</li><li>Bootstrap </li></ul>                                                            ', '2021-05-05 06:00:00', '2021-06-17 06:00:00', '2021-11-05 17:29:33'),
(5, 1, 4, 'Sistema Dorado', 'https://sistemadorado.com', 'uploads/proyectos/sistema-dorado6185e4d089a3a-700.png', 'sistema-dorado', 'El sistema dorado es un tipo de negocio piramidal, en este sistema se destaca el uso de redes sociales.', '                                        <p>El sistema dorado es un tipo de negocio piramidal, en este sistema se destaca el uso de redes sociales y distintos metodos para poder generar ingresos, es un sistema complejo que se desarrollo por varios años y que aun reive nuevas actualizaciones.</p><p>Participe en este proyecto como programador y diseñador, desarrolle distintos modulos como landing pages, funciones internas y diseño de interfaces, tambien preste mi apollo en la solucion de algunos problemas internos del sistema.</p><p>Las tecnologías empleadas en esta página fueron:</p><ul><li>HTML</li><li>CSS</li><li>JavaScript</li><li>PHP</li><li>SQL</li><li>Laravel</li><li>React</li></ul>                                        ', '2020-12-10 07:00:00', '2021-11-05 06:00:00', '2021-11-05 17:49:24'),
(6, 1, 3, 'una sonrisa un juguete', 'https://unasonrisaunjuguete.com/', 'uploads/proyectos/una-sonrisa-un-juguete6185e5bc7e92d-700.png', 'una-sonrisa-un-juguete', 'Este proyecto consta de regalar juguetes a los niños mas necesitados de ecuador y regsla sonrisas', '                                        <ul><li>JUNTOS POR UN JUGUETE Y UNA SONRISA es el proyecto de mayor unidad latinoamericana de los migrantes en los Estados Unidos de Norteamérica para los niños de Ecuador. </li></ul><p>Este proyecto nació del corazón de varios transnacionales, que durante sus vidas han escuchado el llamado a la colaboración al prójimo. Y decidieron unirse para poder trabajar de manera conjunta; artista, empresarios y líderes comunitarios. Consiguiendo de esta manera, objetivos que nunca antes se habían podido efectuar desde el extranjero.</p><p>Este sistema fue completamente desarrollado por mi, este proyecto consta de varios modulos interesantes que dotan de funcionalidad este sitio.</p><p><b>Las tecnologías empleadas en esta página fueron:</b></p><ul><li><b>HTML</b></li><li><b>CSS</b></li><li><b>JavaScript</b></li><li><b>Bootstrap</b></li><li><b>Firebase<br></b><br></li></ul><p>                                        </p>                                        ', '2021-11-05 06:00:00', '2020-12-23 07:00:00', '2021-11-05 18:20:17'),
(7, 1, 4, 'millenniu musa', 'https://www.millenniumusa.net', 'uploads/proyectos/millenniu-musa6185df454d972-700.png', 'millenniu-musa', 'Este es un sitio web que promueve la compra y venta de las cryptomonedas para tener mejores ingresos', '                    <p>El robot de comercio de criptomonedas MUSABOT es un algoritmo informático que utiliza varios indicadores y un escáner de reconocimiento de patrones de gráficos para ejecutar operaciones automáticamente en su nombre. En esencia, este robot comercial es un programa de software que interactúa directamente con los intercambios financieros (utilizando API para obtener e interpretar información relevante) y coloca órdenes de compra o venta en su nombre dependiendo de la interpretación de los datos del mercado.</p><p>Este proyecto fue completamente desarrollado por mi, use un gestor de contenidos para su desarrollo (WORDPRESS).</p><p><br></p><p>                                        </p>                    ', '2021-06-01 06:00:00', '2021-07-07 06:00:00', '2021-11-05 18:33:34'),
(8, 1, 4, 'exit pall', 'https://www.ca-sucre.net/estadistica-voto/index.php/auth', 'uploads/proyectos/exit-pall6185dfe97dc79-700.png', 'exit-pall', 'El exit pall es un proyecto que permite llevar el monitoreo de votaciones en todo el estado miranda', '                    <p>El exit pall es un proyecto que permite llevar el monitoreo de votaciones en todo el estado miranda, permitiendo así sacar estadísticas que permitan visualizar el proceso de votación en el estado miranda.</p><p>Tecnologías implementadas en este proyecto:</p><ul><li>HTML</li><li>CSS</li><li>JavaScript</li><li>PHP</li><li>SQL</li><li>Bootstrap</li><li>Codeigniter</li></ul>                    ', '2021-09-01 06:00:00', '2021-10-21 06:00:00', '2021-11-05 18:49:02');
