INSERT INTO `resumen` (`id`, `user_id`, `resumen`, `activo`, `created_at`) VALUES
(1, 1, '<p>Soy un programador que se especializa en el desarrollo de aplicaciones web, sistemas y desarollo de interfaces agradables visualmente, soy una persona apasionada por la tecnologia</p>', 0, '2021-11-05 13:22:57'),
(2, 1, '<p>Jdjdj djdj fjfj jfjd jfb&nbsp;<span style=\"font-size: 1rem;\">Soy un programador que se especializa en el desarrollo de aplicaciones web, sistemas y desarollo de interfaces agradables visualmente, soy una persona apasionada por la tecnologia</span></p>', 0, '2021-11-05 13:25:38'),
(3, 1, '<p>Hola, soy Samuel, soy Desarrollador Web y especialista en diseño y desarrollo de sistemas. Ayudo a las empresas con el desarrollo de sistemas interactivos que facilitan y disminuyen el tiempo empleado en sus actividades. Una de mis características es que al ser un apasionado por la programación se me facilita el desarrollo de mis actividades y esto conlleva a una mayor eficiencia al momento de entregar mis asignaciones, me aseguro de buscar soluciones a cualquier problema que se presente en el proceso de desarrollo de mis actividades. Me gusta proporcionar ideas y herramientas que ayuden a facilitar el progreso de la actividad. Uno de mis intereses es el aprendizaje de nuevas tecnologías&nbsp; que facilitan el desarrollo de sistemas y aplicaciones, actualmente me especializo en React.js, Laravel y Codeigniter.<br></p>', 0, '2021-11-05 14:48:13'),
(5, 1, '<p>Soy una apacionado por la programación, se me facilita el desarrollo de mis actividades generando una mayor eficiencia al momento de entregar mis asignaciones, me aseguro de buscar soluciones a cualquier problema que se presente en el proceso de desarrollo de mis actividades. Me gusta proporcionar ideas y herramientas que ayuden a facilitar el progreso de la actividad. Uno de mis intereses es la integracion de tecnologías&nbsp; que facilitan el desarrollo de las aplicaciones, actualmente me especializo en React.js, Laravel y Codeigniter.<br></p>', 0, '2021-11-05 15:03:29'),
(6, 1, '<p>Soy una apacionado por la programación, se me facilita el desarrollo de mis actividades generando una mayor eficiencia al momento de entregar mis asignaciones, me aseguro de buscar soluciones a cualquier problema que se presente en el proceso de desarrollo de mis actividades. Me gusta proporcionar ideas y herramientas que ayuden a facilitar el progreso de la actividad. Uno de mis intereses es la integracion de tecnologías&nbsp;<br></p>', 0, '2021-11-05 15:04:34'),
(7, 1, '<p>Soy una apacionado por la programación, se me facilita el desarrollo de mis actividades generando una mayor eficiencia al momento de entregar mis asignaciones, me aseguro de buscar soluciones a cualquier problema que se presente en el proceso de desarrollo de mis actividades. Me gusta proporcionar ideas y herramientas que ayuden a facilitar el progreso de la actividad.<br></p>', 1, '2021-11-05 15:06:26');
