(8, 'Maquetador', 'hola@flyingpigs.es', 'https://www.domestika.org/es/jobs/65136-maquetador-madrid-espana', 'Requisitos:\n- Estudios y conocimientos de tecnologías web front.\n- Experiencia en maquetación con HTML, CSS y JS, sobra decir responsive.', 1, '2022-01-10 23:05:10'),
