(10, '95mc ', 'candidatos@95mc.es', 'https://www.domestika.org/es/jobs/90709-full-stack-web-developer-en-remoto', 'Experiencia de al menos 3 años en desarrollo web.\nPortfolio demostrable con trabajos WordPress / WooCommerce / PrestaShop.\nDesarrollos SEO friendly y optimización SEO on page.\nCapacidad para desarrollar o modificar plugins.\nConocimientos avanzados en HTML, CSS y PHP.\nConocimientos en Frameworks de maquetación Responsive.\nGestión de bases de datos MySQL.', 1, '2022-01-10 23:29:25'),
(11, 'Izertis ', 'alberto.martin@izertis.com', 'https://www.domestika.org/es/jobs/90635-desarrollador-a-frontend-angularjs-en-remoto', ' Toma de requisitos, análisis técnico y funcional.\n\n• Desarrollos ad-hoc.\n\n• Parametrización y configuración de las herramientas.\n\n• Supervisión de todos los entregables y tareas técnicas que deban realizarse.\n\n• Soporte a las áreas funcionales\n\n• Modelo mixto (presencial/teletrabajo).', 1, '2022-01-10 23:31:06'),
(12, 'The Monetise ', 'rrhh@themonetise.com', 'https://www.domestika.org/es/jobs/90542-junior-software-developer-front-practicas-madrid-espana', 'Requisitos:\nConocimientos técnicos deseados\n- TypeScript / JavaScript\n- Node.js\n- React.js', 1, '2022-01-10 23:32:42'),
(13, 'especialistas en salud ', 'vicente@fcweb.es', 'https://www.domestika.org/es/jobs/90564-disenador-web-barcelona-espana', 'Para este diseñador web buscamos conocimientos en\nWordpress\nHtml\nCSS\nWoocommerce\nBootstrap', 1, '2022-01-10 23:34:11'),
(14, 'e-strategia ', 'info@e-strategia.es', 'https://www.domestika.org/es/jobs/62136-maquetador-html-madrid-espana', '-Maquetación de newsletters en html\n-Maquetación de páginas web y landing pages\n-Conocimientos básicos de diseño y/o criterio visual para maquetación.\n', 1, '2022-01-10 23:35:22'),
(15, 'Gosuac ', 'hola@gosuac.com', 'https://www.domestika.org/es/jobs/90951-desarrollador-a-fullstack-madrid-espana', 'Frontend:\n- Serás responsable de implementar nuevos componentes y evolucionar los existentes junto al resto del equipo.\n- Trabajarás junto con UX en dar funcionalidad (React + Apollo) a los componentes diseñados (creando maquetas en JSX y CSS, usando tailwind CSS), y junto con backend para completar nuevas funcionalidad', 1, '2022-01-10 23:38:15'),
(16, 'IVOIN', 'INVOIN@INVOIN.COM', 'https://invoin.com/jobs/desarrollador-front/', 'Ingeniería en Informática o formación similar.\nConocimiento del Sistema Operativo Linux.\nExperiencia en Lenguajes de programación: Java, JavaScript.\nExperiencia en los entornos de trabajo: Spring / Spring Boot / Hibernate / React /Node.', 1, '2022-01-11 03:08:15'),
(17, 'back9', 'info@back9.com.ve', 'https://back9.com.ve/contact-us', 'En back9 reunimos equipos responsables capacitados y multifuncionales, que trabajan mano a mano con los propietarios de productos para mantenerse concentrados, moverse rapido y construir mejor sus ideas', 1, '2022-01-11 03:30:30'),
(18, 'socialyou', 'marketing@socialyou.es', 'https://www.tecnoempleo.com/social-you-trabajo', 'Social You es una consultoría de RRHH especializada en la búsqueda y selección de profesionales expertos y capaces de gestionar su estrategia de Marketing Online/ Digital, Social Media, SEO & SEM y IT.\n', 1, '2022-01-11 15:09:32'),
(19, 'digital talent agency', 'info@dtagency.tech', 'https://www.tecnoempleo.com/digital-talent-agency-trabajo', 'Digital Talent Agency, la agencia de talento digital del grupo empresarial Zemsania Global Group, que cuenta con más de 15 años de experiencia en el sector tecnológico.\n', 1, '2022-01-11 15:16:43'),
(20, 'Krell Consulting', 'info@krell-consulting.es', 'https://www.tecnoempleo.com/krell-trabajo', 'PERFIL DESEADO:\n- Programadores Frontend\n- Conocimientos en la mayoría de las siguientes tecnologías: Vue, React, PHP', 1, '2022-01-11 15:21:11'),
(21, 'Keapps', 'info@keapps.com', 'https://www.tecnoempleo.com/keapps-trabajo', 'Buscamos un/a Programador/a Front en Vue.js o React.js o Angular con al menos 2-3 años de experiencia, para llevar acabo proyectos a nivel internacional en modalidad 100% remoto.\n', 1, '2022-01-11 15:23:13'),
(22, 'Seltime', 'seltime@seltime.es', 'https://www.tecnoempleo.com/seltime-trabajo/', 'Seltime es una compañía totalmente española con clara vocación de liderazgo en el sector de las tecnologías de la información y las comunicaciones focalizándose en ofrecer la mejor solución tecnológica específica que cada cliente necesita centrándose en hacer.', 1, '2022-01-11 15:35:16'),
(23, 'Bitgune', 'info@bitgune.com', 'https://www.tecnoempleo.com/bitgune/re-199497', 'Bitgune es una empresa dedicada al desarrollo de aplicaciones web. Ofrecemos servicio a empresas y marcas que buscan un lugar o aumentar su presencia mediante contenidos digitales para web y dispositivos móviles. Trabajamos en proyectos de gran impacto, desarrollados con y para el cliente. Realizamos consultorías, dando soluciones y adecuando las necesidades al proyecto.\n\n', 1, '2022-01-11 15:37:10'),
