(157, 'CIBERNOS', 'marketing@cibernos.com', 'https://www.infojobs.net/sevilla/programador-javascript-angularjs-100-teletrabajo/of-iac3dc36216423f99b9bc6add64f76d?applicationOrigin=search-new%7Celement%7E43338721794%7Cversion%7ECONTROL&searchId=43338721794&page=1&sortBy=RELEVANCE', 'Formación Profesional Grado Superior - Informática\n', 1, '2022-01-16 19:21:34'),
(158, 'Second Window', 'contacto@secondwindow.es', 'https://www.infojobs.net/madrid/desarrollo-maquetacion-javascript-nativo-teletrabajo/of-ia9fc2b9b72492282c485e015aa4770?applicationOrigin=search-new%7Celement%7E43338721794%7Cversion%7ECONTROL&searchId=43338721794&page=1&sortBy=RELEVANCE', 'Estudios mínimos\nCiclo Formativo Grado Superior\nExperiencia mínima\nAl menos 3 años\nImprescindible residente en\nNo Requerido', 1, '2022-01-16 19:29:59'),
