(160, 'MEHRS Keep on Grow!ing', 'info@mers.es', 'https://www.infojobs.net/santa-perpetua-de-mogoda/marketing-assistant-community-manager/of-ib0ebb41fff4df98340a4b508df57b9?applicationOrigin=search-new%7Celement%7E43339170378%7Cversion%7ECONTROL&searchId=43339170378&page=2&sortBy=RELEVANCE', '-EXPERIENCIA 2-3 AÑOS EN MARKETING, COMUNICACIÓN Y REDES SOCIALES\n- INGLÉS NIVEL AVANZADO (ADVANCED, PROFICIENCY)\n- METICULOSIDAD/RIGOR\n- COMUNICACIÓN\n- ORIENTACIÓN A RESULTADOS\n- INQUIETUDES DE APRENDIZAJE\n- PLANIFICACIÓN/ORGANIZACIÓN\n- POLIVALENCIA.', 1, '2022-01-16 19:46:20'),
(161, 'Técnico/a de Marketing y Diseño Gráfico', 'info@ifevet.com', 'https://www.infojobs.net/barcelona/tecnico-marketing-diseno-grafico/of-ifcec7a1f574656ae0d0034e9b3e449?applicationOrigin=search-new%7Celement%7E43339170378%7Cversion%7ECONTROL&searchId=43339170378&page=2&sortBy=RELEVANCE', 'Ifevet es un proyecto líder en formación continuada para veterinarios y queremos ampliar nuestro equipo de marketing digital incorporando un técnico/a de marketing que pueda tener recorrido en el proyecto: https://ifevet.com/\n\n', 1, '2022-01-16 19:51:18'),
(162, 'BETWEEN Technology', 'info@talens.tech', 'https://www.infojobs.net/madrid/frontend-developer-react/of-i3d7755ed6d440d86214c5e7c74363f?applicationOrigin=search-new%7Cversion%7ECONTROL&page=1&sortBy=RELEVANCE', 'En BETWEEN apostamos por el mejor talento dentro del sector tecnológico. Nos involucramos en una gran variedad de proyectos punteros, trabajando con las últimas tecnologías. Actualmente en BETWEEN contamos con un equipo de más de 500 personas.\n\nTrabajamos en ámbitos como BI, IoT, Big Data e I+D. En el área de Operaciones implantamos proyectos de Service Desk, Infraestructuras IT y proyectos Cloud, entre otros.\n\nActualmente seleccionamos un/a Frontend developer con Reactjs para incorporarse de forma indefinida en uno de los equipos que Between tiene implantados en uno de nuestros principales clientes del sector transporte.\n\nLa persona seleccionada participará en proyectos internacionales,\n\n-Teletrabajo del 50%\n-Flexibilidad horaria\n\nAdemás, trabajando para BETWEEN obtendrás los siguientes beneficios añadidos:\n\n-Seguro médico incluido por ser Betweener\n-Posibilidad de formar parte de una empresa en pleno crecimiento a nivel nacional e internacional. Un buen lugar donde trabajar: cuidamos de nuestro equipo y la sociedad a través de iniciativas, programas de conciliación y de responsabilidad social corporativa\n-Te integrarás en un equipo de alto rendimiento y con un alto grado de especialización.\n-Dispondrás de oportunidades de formación y desarrollo profesional\n-Pondremos a tu disposición un amplio abanico de retos y proyectos acordes con tus objetivos personales y profesionales.\nPosibilidad de elegir cómo obtener parte de tu salario gracias a las ventajas fiscales de nuestra Retribución Flexible, y descuentos para acceder a centros de fitness, entre otros.\n\nEn BETWEEN, la igualdad de oportunidades es uno de nuestros valores. Nuestro compromiso es contratar al mejor talentos independientemente de su raza, religión, sexo, edad y personas con otras capacidades y promover su desarrollo profesional y personal.', 1, '2022-01-17 15:16:20'),
(163, 'Entelgy', 'rrhh@entelgy.com', 'https://www.infojobs.net/madrid/frontend-reactjs-developer/of-i10a0a94db842e7b6463edd4a7545f5?applicationOrigin=search-new%7Cversion%7ECONTROL&page=1&sortBy=RELEVANCE', '¿Eres Desarrollador Front y te interesa formar parte de proyectos de diseño y desarrollo desde cero con Javascript y React? ¿Te encanta trabajar con las últimas tecnologías Front (React, Hooks, Redux, Webpack)? Si te interesa participar en proyectos muy innovadores de últimas tecnologías en Banca Digital, esta es tu oportunidad. Conoce las ventajas de trabajar en Entelgy. PENSANDO EN TI te ofrecemos:\n\nEntelgy College: NUESTRA UNIVERSIDAD\n\n- Self Service Digital: ELIGE tu FORMACIÓN\n- Soluciones de Vanguardia: A TU MEDIDA\n- Planes de Certificación: CERTIFÍCATE!\n- Idiomas : Digital y presencial\n- Itinerarios de desarrollo: CRECE\n\nComunidades de Talento: EMPRENDE y CO-CREA en las células de innovación\n\nPlan Flexible Working: CONCILIACIÓN\n\nMyFlex: RETRIBUCIÓN FLEXIBLE, Tarjeta Restaurant, Tarjeta transporte, Seguro de Salud y Cheques Guardería\n\nMyClub: CLUB DEL AHORRO, portal con más de 450 descuentos para empleados\n\nSPORTCLUB: liga de fútbol, baloncesto, carreras, maratones y corporate sport game\n\nY mucho más...descúbrelo\n\n¿Qué vas a hacer?\n\nFormarás parte de un equipo (célula) de desarrollo de soluciones innovadoras.\n\n- Desarrollo proyecto completo desde cero de parte Frontend con ReactJS\n\n- Análisis, Desarrollos, pruebas, coordinación con equipo QA\n\n- Metodologías ágiles Scrum bajo formato de teletrabajo.\n\n¿Quieres saber más?\n\nSomos The BusinessTech Consultancy, un acelerador de la transformación digital, con más de 1.700 profesionales presentes en España, Brasil, Chile, Argentina, Colombia, Perú, México y USA. Ofrecemos soluciones integradas y globales que nos hacen ser diferenciales, a través de nuestras 4 divisiones: Consulting Tech, Transformación Digital, Seguridad y Outsourcing.\n\nForma parte de un gran equipo en una empresa con una CULTURA DIGITAL y AGILE, orientada a las Personas y el Talento.\n\n¡Los mejores proyectos te esperan!\n\nhttps://www.youtube.com/watch?v=BZD3ufY6vGI&amp;amp;t=31s\n\n¿Estás listo para venirte con nosotros?\n\n¡Únete al equipo! ¡Te estamos esperando!', 1, '2022-01-17 15:24:39'),
(166, 'dsadsa', 'sadsadsa@dsa.dsa', 'https://www.infojobs.net/jobsearch/search-results/list.xhtml?keyword=Frontend%20developer&amp;normalizedJobTitleIds=2512_866c7813-2c03-47d7-9bdc-192cfbace57c&amp;provinceIds=&amp;cityIds=&amp;categoryIds=&amp;workdayIds=&amp;educationIds=&amp;segmentId=&a', '<p>dsadsads</p><p>dsad</p><p>dsadsa</p>', 1, '2022-01-17 15:54:25'),
(167, 'intelygenz', 'info@intelygenz.com', 'https://www.infojobs.net/madrid/frontend-developer-react.js/of-ib57ef2161f47d9beb04b2e9d4ffa61?applicationOrigin=search-new%7Cversion%7ECONTROL&amp;page=2&amp;sortBy=RELEVANCE', 'We\'re looking for a Frontend Developer to bring their expertise to some great projects, learn in a friendly, collaborative environment, and innovate with us.\n\nWe are totally committed to microservices architecture embracing Clean Code, ATDD, HonestCode, and Cloud Computing, all of this in an agile environment and a DevOps culture.\n\nWhat are you going to do?\n\nYou will be part of an agile team of amazing developers. and even better people!\n\nDailys, retrospectives...\n\nQuality is a must for us.\n\nContinuous integration, test, and delivery are part of our DNA\n\nWhy Intelygenz?\n\n- Flexible working hours for a real work-life balance\n- 100% freedom to work from anywhere you\'d like - from your home, our office, or even from a tropical island!\n- Specific career plans for horizontal and vertical growth. Let your motivations do the talking!\n- Mentoring to help you grow in your career\n- Teamwork and feedback culture\n- English and Spanish language classes with up to 60% of costs covered by us\n- Plenty of happy hours, retreats and events with us (post-Covid)\n- One hour per week to take part in continuous tech training programs with your co-workers\n- Access to physical and mental wellness initiatives\n50% health insurance coverage\n- Flexible retribution for transport, kindergarten, and restaurant meals\n- A free Intelygenz t-shirt every anniversary\n\nTipo de industria de la oferta\nProgramación, Consultoria y otras Activ. informaticas', 1, '2022-01-17 16:03:02'),
