(189, 'BE REBEL', 'jobs@berebel.io', 'https://www.domestika.org/es/jobs/79508-desarrollador-de-aplicaciones-valencia-espana', 'En BE REBEL buscamos un desarrollador frontend con buen gusto por el diseño y con experiencia en desarrollo de Apps híbridas con Angular e Ionic.\n\nNuestros requisitos para el puesto son:\n\n• Experiencia demostrable de al menos 2 años en el desarrollo SPAs, PWAs, APPs híbridas, etc.\n• Conocimientos avanzados de Angular 7+, SASS, ES6, HTML5, Ionic, Firebase, SQL.\n• Seguir los estándares básicos de programación (MVC, patrones de diseño, modularización, reusabilidad, TDD, etc).\n• Buen gusto por el diseño.\n• Desarrollo y consumo de APIs.\n• Diseño pixel-perfect y responsive.\n• Buenas prácticas en consideraciones de accesibilidad, estándares web actuales y experiencia de usuario (UX).\n• Nivel de inglés medio-alto (al menos leído y escrito), ya que trabajarás con clientes de todo el mundo.\n• En constante renovación y auto-aprendizaje de las nuevas tecnologías que vayan surgiendo.\n• Buena adaptación al trabajo en equipo.\n• Que sea de la zona de Valencia (el puesto es presencial).\n\nExtras valorables:\n\n• Desarrollo de APIs en la parte del servidor (con PHP y/o Node).\n• Conocimiento de otros frameworks Javascript (React, VUE, etc).\n• Conocimientos de desarrollo de bloques de Gutenberg para WordPress (usando React).\n• Conocimiento de otros frameworks para APPs híbridas (NativeScript).\n• Lenguajes de desarrollos de APPs nativas (Swift, Objective C, Java, Kotlin, etc).\n• Conocimientos de JIRA y Agile Development.\n• Dominio de animaciones con CSS y Javascript (GreenShock, ScrollMagic, ThreeJS etc).\n• Conocimientos avanzados de WordPress y WooCommerce.\n• Conocimientos avanzados de despliegue y gestión de servidores en Amazon AWS.\n• Perfil en GitHub con colaboraciones en proyectos (propios o de terceros).\n• Portfolio online.\n• Creatividad.', 1, '2022-01-20 15:53:40'),
(190, 'Jobstoday World S.L', 'jobs@jobstoday.world', 'https://www.domestika.org/es/jobs/86845-php-web-developer-practicas-en-remoto', 'We are looking for a recent college graduate to join our team as a Web developer Apprentice.\n\nAt Jobstoday.world, apprentices are treated like full-time hires and are expected to contribute and make an impact.\nOur apprenticeship program is all about continued learning and hands-on experience with real clients and internal work.\nMany of our apprentices eventually become full-time employees, and we put you on that path from day one if you are willing to work and excel.\n\nIn this role, you will have the opportunity to learn and execute a variety of web development tasks and develop a solid understanding of web applications.\n\nWe offer you a great chance to learn & develop very good skills in PHP web application development.\n\nWhat we are looking for:\nKnowledge of Object-oriented programming in any PHP Frameworks\nBasic design capability\nUnderstanding basic prototype design, UI design, UX design\nKnowledge of Databases MYSQL\nBasic Knowledge of Elastic Search\nKnowledge of CSS/HTML5\n\nAn ideal candidate will have:\nDegree in Information Technology\nAbility to learn fast & develop new skills\nGood English & Spanish language skills.\nA highly analytical mind.\nHave a willingness to learn, help out, and go the extra mile.\nBe flexible and adaptable in managing your time and schedule in a rapidly changing environment.\nHave a positive attitude in everything you do.\nBe always ready to take on a new challenge and the intuition and good judgment to get through it successfully.\n\nApply today with your resume in English, and let\'s start the conversation!', 1, '2022-01-20 15:54:47'),
