(206, 'ORIZON soluciones tecnologicas ', 'tecnologia@orizonweb.es', 'https://www.tecnoempleo.com/desarrollador-sharepoint-100-remoto-100-en-remoto/sharepoint-net-api-rest-/rf-a664f27cdv3d3wd6da88', '- Desarrollo en .NET con IDE MS Visual Studio y VS Code.\n- Desarrollo en SharePoint/SharePoint Online y API Rest con C#.\n- BBDD MS SQL Server / Azure.\n- SPFx.\n- .NET.\n- Framework de .NET.\n- Control de versiones (GIT).\n- Responsive Design para diseño móvil (Bootstrap, etc.).\n- jQuery, JavaScript, HTML 5.0, CSS 3.0, etc.\n- SharePoint Designer (páginas maestras, diseños de página).\n- SharePoint Online y Office 365.', 1, '2022-01-20 20:04:35'),
(207, 'Elsamex', 'contacto@elsamex.com', 'https://www.opcionempleo.com/jobad/esd70d3f52f28bf4207f7c3f7d1bb944c8', 'Buscamos candidaturas con conocimientos avanzados de informática y desarrollo de software, e interés en los ámbitos de gemelos digitales e Inteligencia Artificial (IA), con experiencia en la implementación y despliegue de aplicaciones que requieran integrarse con bases de datos, APIs e información bruta (estructurada y no estructurada), en entornos Web . Será necesario poseer experiencia en gestión de infraestructuras informáticas y configuración de redes.\n', 1, '2022-01-20 20:14:40'),
