(209, 'Acertto', 'info@acertto.es', 'https://www.opcionempleo.com/jobad/esa3f6f962226c17d68c1fe3b8c3c1feb6', 'Requisitos mnimos:\nEstudios de Informtica;\n3/5 aos de experiencia en desarrollo de aplicacin web en PHP + MySQL ;\nExperiencia en HTML, CSS y Javascript.\n', 1, '2022-01-20 20:30:18'),
(210, 'GMV', 'privacy@gmv.com', 'https://www.opcionempleo.com/jobad/es10419e29da0d14a6bc4433ff2c9f9576', 'Si te gustan la tecnología los proyectos innovadores y diferentes ¡tu sitio está con nosotros! Si aún no nos conoces somos una empresa de ingeniería que trabajamos en distintas áreas\ncomo espacio robótica ciberseguridad inteligencia artificial o big data con proyectos internacionales.', 1, '2022-01-20 20:33:57'),
(211, 'CellFusion', 'informationrequest@cellfusion.com', 'https://www.occ.com.mx/empleo/oferta/14630830-programador-desarrollador-developer-software?ai=false&origin=unknown&page=1&rank=3&returnURL=%2Fempleos%2Fde-programador%2F%3F__cf_chl_jschl_tk__%3DCi.vS.GXSz7RORyu1Um3A9o1J9D_J21R2.YLRWYBUvY-1', 'Java programming language, required Java swing graphical programming language, required Object oriented programming and code structuring, required SQL language and syntax, required Code management software, GIT/ SVN required Eclipse IDE', 1, '2022-01-21 20:51:28'),
