(216, 'Hogarth Worldwide', 'javier.sanchez@hogarthww.com', 'https://www.domestika.org/es/jobs/89504-technology-project-manager-en-remoto', 'Líder Global en Servicios de Tecnología y Producción.\nTrabajamos como partner para las agencias de WPP y clientes directos, entendiendo sus necesidades y objetivos, para ofrecer soluciones y servicios de Tecnología de forma inteligente, ágil y eficiente con las que conseguir proyectos brillantes, con el mejor valor y calidad, y que ayuden a alcanzar el éxito de nuestros clientes.\nEl mundo de la tecnología no para de cambiar. Con nuevas experiencias, canales, audiencias y expectativas queremos seguir liderando y guiando a nuestros clientes para ofrecer soluciones inteligentes, personalizadas, efectivas y que permitan conectar con el consumidor. Por eso reunimos al mejor talento para hacer el mejor trabajo de forma brillante combinando artesanía, datos y tecnología para darle vida a la creatividad y conseguir los mejores resultados.\nAspiramos a no dejar nunca de innovar y a ser felices dándolo todo mientras hacemos lo que nos gusta.', 1, '2022-01-25 00:34:29'),
(217, 'Sh Marketing', 'info@sh.marketing', 'https://www.domestika.org/es/jobs/89494-desarrollador-web-en-remoto', 'agencia de Marketing digital cuyo máximo objetivo es impulsar las ventas online y optimizar el ROI de los clientes, a través del Search Marketing. ¿Quieres trabajar con nosotros?\n\nEn este momento, estamos buscando la figura de un Desarrollador/a Web Freelance que colabore con nosotros y domine los principales CMS como Wordpress (Woocommerce), Prestashop, Shopify... y con conocimientos de HTML, CSS y PHP.', 1, '2022-01-25 00:34:29'),
(218, 'Shackleton ', 'empleo@shackletondigital.com', 'https://www.domestika.org/es/jobs/70469-programador-creativo-full-stack-en-remoto', 'buscamos Programador Creativo para cubrir una baja de 8 meses, con posibilidad de quedarse en el equipo.\n\nEs importante que sea una persona que entienda lo que implica trabajar en una agencia de publicidad.\n\nRequisitos mínimos:\n- Javascript / Typescript\n- Angular\n- HTML5 CSS / SCSS\n- PHP (experiencia en Codeigniter)\n- MySQL\n- Git\n- Docker\n- Wordpress\n- Plesk admin + Linux admin\n- Experiencia demostrable de 2-3 años\n- Gusto por los detalles y el trabajo bien hecho', 1, '2022-01-25 00:34:29'),
(219, 'Binalogue ', 'jobs@binalogue.com', 'https://www.domestika.org/es/jobs/89385-desarrollador-laravel-vue-en-remoto', 'Es imprescindible que el/la candidato/a que buscamos cumpla con lo siguiente:\n- Laravel & VueJS\n- Statamic CMS\n- HTML5 & CSS3\n- GTM & Analytics\n- Gestión servidores Nginx, Linux, Apache, Google.\n- Repos GitLab, GitHub, BitBucket, etc.\n- Laravel Forge', 1, '2022-01-25 00:34:29'),
(220, 'Codifica', 'administracion@codifica.es', 'https://www.domestika.org/es/jobs/89159-desarrollador-a-web-php-en-remoto', 'Queremos un equipo de personas emprendedoras, resolutivas, valientes y responsables que trabajen en colaboración con nosotros sin necesidad de horarios ni ligaduras.\n- Dominio avanzado de PHP.\n\n- Buen dominio de Wordpress y/o Prestashop.\n\n- Conocimientos de HTML5 y CSS3.\n\n- Actitud proactiva y resolutiva.\n\n- Transparencia en habilidades y limitaciones\n\n- Capacidad de organización y gestión.\n\n- Ubicación en España.\n', 1, '2022-01-25 00:34:30'),
(221, 'Guindo Design', 'carol@guindo.com', 'https://www.domestika.org/es/jobs/89139-desarrollador-a-front-full-stack-developer-en-remoto', 'Somos un equipo de diseñadores de interacción con sede en Barcelona. Ayudamos a definir productos y servicios digitales, desde el concepto del servicio al diseño visual e implementación front-end.\n\nSe trata de un proyecto grande, así que tendrás recurrencia de trabajo. Se prevee una dedicación estimada de unas 40/50 horas mensuales. Horario flexible con disponibilidad para tener reuniones preferiblemente por la mañana.\nEstamos en Barcelona pero podrías trabajar de forma remota.', 1, '2022-01-25 00:34:30');
INSERT INTO `trabajos` (`id`, `nombre`, `email`, `url_trabajo`, `descripcion`, `enviado`, `created_at`) VALUES
(222, 'boream ', 'rrhh@boream.com', 'https://www.domestika.org/es/jobs/88816-desarrollador-php-drupal-en-remoto', ' conocimientos en frameworks PHP (Symfony, laravel...), y que también tenga manejo suficiente de Frontend.\n\nNecesitamos una persona que cumpla los siguientes requisitos:\n* Nivel alto en Drupal 8 y 9, y su conjunto de módulos contribuidos.\n* Conocimiento a detalle del API, aplicado habitualmente en el desarrollo módulos custom.\n* Dominio del lenguaje PHP y sus frameworks, en especial Symfony 2.\n* Experiencia Theming (HTML5 / CSS3 / JS) para la adaptación de templates Twig.\n* Capacidades de configuración, securización, despliegue y optimización de performance de entornos.\n* Experiencia mínima de 2 años.', 1, '2022-01-25 00:34:30'),
(223, 'BLOCKZY TECHNOLOGIES', 'assistant@inkainvestments.com', 'https://www.domestika.org/es/jobs/88682-quality-analist-en-remoto', 'BLOCKZY TECHNOLOGIES es una plataforma FinTech, especializada en la implementación y comercialización de plataformas de pagos transfronterizos basados en la tecnología Blockchain. Actualmente tenemos presencia corporativa en más de 11 países entre Europa, Asia y América Latina, nos respaldan 30 entidades financieras y contamos ya con más de sesenta y cuatro mil puntos de recarga.\n\n- Testear la aplicacion web en PHP Codeigniter.\n- Testear La app movil con ionic v3.\n- Testear APIs.\n- Busqueda de vulnerabilidades y pen testing.\n- Testing unitario.\n- Mejorar la seguridad de los servicios ofrecidos al publico.\n- Mejorar el rendimiento y eficiencia de la base de datos (No excluyente).', 1, '2022-01-25 00:34:30'),
(224, 'Soshace', 'sales@soshace.com', 'https://www.remotehub.com/jobs/details/laravel-back-end-web-developer-remote-5f44d2a9edae3a14c337bfc5?utm_source=jooble&utm_medium=cpc&utm_campaign=allvacancies', 'Trabajo a distancia en proyectos internacionales 40 horas semanales de una carga de trabajo Titulación requerida actualmente: Medio y Senior. Soshace es una plataforma de contratación en línea que conecta a los desarrolladores web con los clientes. Si pasa el proceso de prueba y entrevista de cuatro etapas, se le ofrecerá un trabajo remoto en el que trabajará con tecnología de punta en proyectos modernos que duran en promedio de 6 a 9 meses y se le pagará por hora. Se espera que trabaje en proyectos alrededor de ocho horas al día de lunes a viernes en su zona horaria. Requisitos: Más de tres años de experiencia comercial con PHP Al menos un año de experiencia comercial con Laravel Suficiente experiencia con bases de datos y arquitectura de aplicaciones web Portafolio con proyectos relevantes Buen dominio del idioma inglés. Si todo lo anterior es sobre ti, entonces, responda con su CV y ​​cartera de desarrolladores. Nuestras tarifas por hora dependen de su calificación: $ 20- $ 30 por hora. Espere las siguientes etapas más adelante en el proceso de entrevista: Prueba en línea Entrevista con un especialista en tecnología Si está interesado en un trabajo, complete el formulario:https://soshace.com/\n', 1, '2022-01-25 00:34:30'),
(225, 'Suprive ', 'joan@suprive.com', 'https://www.domestika.org/es/jobs/88612-desarrollador-frontend-en-remoto', 'Dominio de HTML5 y CSS3\n- Nivel alto en Javascript Vanilla y EcmaScript6\n- Uso de preprocesador CSS SASS\n- Uso de framework Bootstrap 5\n- Desarrollo de Aplicaciones SPA con React\n- Uso del CMS Nextjs\n- Redux y/o Context API\n- Conocimiento de API Rest\n- Control de versiones en GIT', 1, '2022-01-25 00:34:30'),
(226, 'Iterátika', 'info@iteratika.studio', 'https://www.domestika.org/es/jobs/88577-maquetador-html-en-remoto', 'Importante: enviar portfolio de trabajos.\n- Maquetación responsive.\n- Conocimientos en HTML5+CSS3, Javascript (Angular, React..) y jQuery.\n- Experiencia en Frameworks y librerías como Bootstrap.\n- Experiencia en soporte a usuarios.', 1, '2022-01-25 00:34:30'),
(227, 'Mood 481 Studio', 'penfield@mood481.es', 'https://www.domestika.org/es/jobs/88300-desarrollador-a-web-en-remoto', 'Somos un pequeño estudio enfocado al diseño de software, desde su concepción inicial, hasta el prototipado, programación y posterior despliegue y mantenimiento.\n\nEn el ámbito del desarrollo puro y duro, trabajamos en varios entornos y tecnologías. Javascript: Angular, React, Ionic, Node (Nestjs, Loopback y Next) entre otros; PHP: Symfony, Laravel, principalmente; Python; AWS; Firebase.\n\nActualmente buscamos un colaborador freelance con experiencia en el front y especialmente con Ionic/An', 1, '2022-01-25 00:34:30'),
(228, 'gurneet kaur', 'gurneet.eminence@gmail.com', 'https://www.remotehub.com/jobs/details/mern-stack-developer-freelancer-full-time-60780a8cedae3a1bb06c4f5e?utm_source=jooble&utm_medium=cpc&utm_campaign=allvacancies', 'Mern stack Freelancer a tiempo completo Trabajo desde casa Exp - 2 - 7 años Pago de la discusión (por hora) Tener conocimiento en React y Node Mongo DB, Debería ser capaz de administrar el trabajo a tiempo de 9.30 a.m. a 6.30 p.m. (6 horas) / día) Envíe su CV a gurneet.eminence@gmail.com\n\ncontactar directamente 8264431557 Habilidades requeridas: Capacidad para contribuir individualmente Experiencia en Complete Mean, Node js, Mongodb, React, Angular js y Express js Experiencia en PHP, jQuery, MySQL, Symfony, OOPS Capacidad para administrar y liderar un equipo de desarrolladores Fuerte analítica y Habilidades de resolución de problemas Calificaciones: Licenciatura en Ciencias de la Computación o campo relevante Experiencia desarrollando aplicaciones basadas en web en C #, HTML, JavaScript, VBScript / ASP o .NET Experiencia trabajando con MS SQL Server y MySQL Conocimiento de prácticas y procedimientos para software completo experiencia del ciclo de vida del diseño trabajando en un entorno de desarrollo ágil', 1, '2022-01-25 00:34:30'),
(230, 'Agencia Reinicia', 'trabajarmola@agenciareinicia.com', 'https://www.domestika.org/es/jobs/88107-desarrollardor-front-end-en-remoto', 'Queremos una persona a la que de verdad le mole su trabajo, con gusto estético, que pueda adaptarse a nuestra forma de codificar, sin miedo a aportar ideas, analítica, metódica, responsable en el trabajo, alegre y con ganas de aprender, no solo web, sino también marketing y comunicación, porque trabajarás mano a mano con buena parte del Equipo.\n\nAh, muy importante, trabajamos con metodologías ágiles, por lo que si no estás acostumbrado, tendrás que hacer un pequeño esfuerzo, pero no te preocupes, porque te ayudaremos y verás que merece la pena la adaptación ;]', 1, '2022-01-25 00:34:30'),
(231, 'Citroflex ', 'contacto@citroflex.com', 'https://www.domestika.org/es/jobs/86169-experto-en-prestashop-en-remoto', 'Subida y Edición de Productos\n- Crear descuentos en toda la tienda, crear cupones.\n- Modificación de cualquier parte del diseño.\n- Creación de Nuevas Páginas o Módulos.\n- Corrección de Errores, Enlaces Rotos, etc.\n- Optimización de velocidad (imágenes, caching, defer, etc).\n- Añadir o Eliminar Métodos de Pago.\n- Administración de DNS, gestión de firewall y catching con Cloudflare.\n- Configuración de Backups con ManageWP.\n- Añadido de Scripts adicionales (Facebook Pixel, Hotjar, Analytics).', 1, '2022-01-25 00:34:30'),
(233, 'Banner Publicidad', 'empleo@interbanner.com', 'https://www.domestika.org/es/jobs/87625-programador-web-front-end-en-remoto', 'HTML5, CSS, JQuery, Javascript y Bootstrap.\nDominio de WordPress/WooCommerce.\nConocimientos de PHP y MySql\nMantenimiento de páginas web.', 1, '2022-01-25 00:34:30'),
(235, 'Doubledot', 'vanessa.elvira@doubledot.es', 'https://www.domestika.org/es/jobs/86987-desarrollador-back-end-php-laravel-mysql-en-remoto', 'Cualidades y Requisitos básicos:\nBuscamos un perfil de back-end que tenga conocimientos en PHP, MYSQL, Laravel, JS / JQuery, HTML, Sass, Git, Symfony, Wordpress.\n\n', 1, '2022-01-25 00:34:30'),
(236, 'Vio technologies', 'vilo2021@gmail.com', 'https://instagram.com/vilotechnologies.cc?utm_medium=copy_link', '', 1, '2022-01-25 00:34:31'),
(237, 'WAD MUSIC', 'davidcampoy@aseremusic.com', 'https://www.domestika.org/es/jobs/86669-desarrollador-a-full-stack-en-remoto', 'No importa el lenguaje de programación (HTML, PHP, JAVA, JSON, ANGULAR,...), ya que arranca de cero. Siempre que pueda desarrollar el proyecto de una manera eficiente estamos abiertos a que utilice el que más cómodo se sienta.\n', 1, '2022-01-25 00:34:31'),
(238, 'Curious Tech', 'amerino@curious.tech', 'https://www.domestika.org/es/jobs/86567-chief-technology-officer-en-remoto', 'xperiencia en proyectos desarrollados con lenguajes orientados a objetos y arquitectura MVC (valorable PHP con frameworks Symfony, Laravel, etc).\n• Experiencia en proyectos desarrollados con frameworks javascript reactivos (Angular, VUE, React…).\n• Experiencia en el uso de APIs: proyectos de creación y evolución de APIRest, implementación de arquitecturas de microservicios.\n• Sistemas cloud y DevOps: experiencia en sistemas cloud, implementación de procesos de integración continua, despliegue automático, revisión de código y sistemas basados en contenedores.\n• Valorable: Experiencia con stacks tecnológicos de marketing digital: recolección, segmentación, atribución y activación de data\n• Idiomas: nivel de Inglés Alto, profesional.', 1, '2022-01-25 00:34:31'),
(239, 'JohnAppleman®', 'info@johnappleman.com', 'https://www.domestika.org/es/jobs/86248-director-creativo-en-remoto', 'Y es que necesitamos un perfil experimentado con ganas de demostrar lo que vale, un/a AS del Branding y el Diseño Web, capaz de dirigir un proyecto y llevarlo a buen puerto en contacto directo con cliente.\n\nNo estarás solo, pues aunque esperamos de ti que organices y orientes creativa y estratégicamente los proyectos, tendrás el apoyo de arte, desarrollo y dirección.', 1, '2022-01-25 00:34:31'),
(240, 'KONECTA CORPORATIVA', 'alejandra.bucetal@grupokonecta.com', 'https://www.domestika.org/es/jobs/86193-junior-qa-tester-en-remoto', 'QA Testing: Definición, planificación y ejecución de pruebas operativas en CMS y otras herramientas de distintas tecnologías y nuevos desarrollos para asegurar correcto funcionamiento de las herramientas.\n\n· Gestión (registro y seguimiento) de defectos, incidencias y posibles mejoras operativas detectadas en diferentes herramientas y desarrollos web.\n\n· Definición y ejecución de procesos automatizados de testing.\n\n· Validaciones y pruebas regresivas en distintas aplicaciones tras despliegues o intervenciones planificadas.\n\n· Soporte a equipos de gestión de contenidos web (sesiones formativas, generación de documentación de apoyo, planteamiento de mejoras operativas...)\n\n· Análisis, seguimiento y optimización de SEO y Accesibilidad en distintos portales web.\n\n· Extracción y análisis (interpretación, resumen y planteamiento de oportunidades de mejora) de métricas web desde distintas fuentes y presentación de datos y conclusiones a través de informes detallados.', 1, '2022-01-25 00:34:31'),
(241, 'Ampliffy ', 'info@ampliffy.com', 'https://www.domestika.org/es/jobs/86099-senior-full-stack-developer-en-remoto', 'Su vida comienza y termina con una barra.\nSiente que tiene una misión, no solo una tarea, y escribe código en back-end y front-end comprobable en PHP, JavaScript y HTML / CSS.\nEntiende el desarrollo iterativo y un día sin presionar código le entristece.\nNo tiene miedo de abrir un código base existente y doblarlo a su voluntad.\n\"Self Starter\" es su segundo nombre. Puede tomar o proponer una idea de alto nivel y ejecutarla.\nEntiende cómo funciona la web y sabe cómo optimizar un sitio web para el rendimiento.\nNo puede imaginar su vida sin una pizarra, pizarrones de código abierto y definitivamente CÓDIGO.\nComo experto en software, defenderá y practicará la programación de pares, las pruebas unitarias, la refactorización, la propiedad del código colectivo y la integración continua.\nSiempre deja el código mejor de lo que lo encontró (regla Boyscout).\nPuede resolver problemas técnicos igualmente bien con OO, orientado a DOM o JS funcional.\nTiene la capacidad de crear una interfaz usando JavaScript, HTML y CSS.\nTiene un conocimiento sólido de las etiquetas HTML5: funciones e intención.', 1, '2022-01-25 00:34:31'),
(242, 'Increnta ', 'ssa@increnta.com', 'https://www.domestika.org/es/jobs/85852-desarrollador-web-en-remoto', 'Será en remoto por lo que no será necesaria la presencia física.\nSe requiere experiencia acreditable en maquetación en Hubspot con la aportación de ejemplos realizados.\nTenemos trabajo para hacer desde ahora mismo y de forma continua.', 1, '2022-01-25 00:34:31'),
(243, 'Webimpacto Consulting', 'brigol@webimpacto.es', 'https://www.domestika.org/es/jobs/85622-desarrollador-web-senior-en-remoto', ' Experiencia en Prestashop\n* PHP OO (Orientado a Objetos).\n* Lenguajes Web: HTML/JS/CSS.\n* MySQL (deseable también parte de administrador de sistema de servidor, pero realmente como hacer consultas SQL eficientes).\n* Git/GitHub.\n* Haber trabajado con Webservice/APIs y la filosofía detrás de esto (endpoints, requests, responses, auth, parsing, etc..)', 1, '2022-01-25 00:34:31'),
(244, 'SMART HUMAN CAPITAL', 'seleccion@smarthc.es', 'https://www.domestika.org/es/jobs/85505-programador-desarrollador-web-en-remoto', 'Programador y/o Desarrollador Web que haya trabajado y pueda aportar a partir de 3 años de experiencia con las siguientes tecnologías:\n\n-HTML5, CSS, Javascript nativo, o vanilla.js\n-PostCSS\n-Metodología de BEM( BEM CSS)\n-Atomic Design\n-Git flow\n-Flex box\n-Muy importante trabajar y conocer vanilla.js o javascript nativo.\n\n¿Qué ofrecemos?', 1, '2022-01-25 00:34:31'),
