(250, 'Regalador.com ', 'trabajo@regalador.com', 'https://www.domestika.org/es/jobs/83168-desarrollador-a-web-en-remoto', 'Buscamos a alguien que lleve años trabajando con frameworks PHP, a quien le guste desarrollar con orientación a objetos y utilizando las mejores prácticas y que odie reinventar la rueda. Queremos aprender de ti y que aprendas de nosotros para juntos hacer de Regalador.com una tienda cada día mejor.\n\n- Control absoluto de PHP y Javascript orientado a objetos en su interacción con HTML y CSS\n- Experiencia mínima de 3 años como desarrollador en equipo usando GIT\n­- Soltura con Linux, LAMP y SQL\n­- Tener la visión global de la arquitectura que rodea una aplicación web de última generación (tecnologías, interacciones, seguridad, protocolos, tiempos...)\n­- Aplicar buenas prácticas de desarrollo (¿SOLID significa algo para tí?, TDD...)\n­- Código propio como ejemplo de trabajo\n', 1, '2022-01-25 00:34:31'),
