(254, 'Digital Bakers ', 'digitalbakers@digitalbakers.com', 'https://www.domestika.org/es/jobs/82638-senior-drupal-developer-en-remoto', '- Disponer de conocimientos y experiencia demostrable en SQL y MySQL\n- Disponer de conocimientos y experiencia demostrable en programación de buenas prácticas SEO.\n- Disponer de conocimientos y experiencia demostrable en frameworks JS como React, Angular o Vue.\n- Disponer de conocimientos y experiencia demostrable en desarrollo con Docker y Docker Composer.\n\nQueremos reforzar nuestro equipo de producción con desarrolladores freelance con un mínimo de 3 años de experiencia en proyectos web basados en Drupal 8.x / 9.x. (se valorará también experiencia en Drupal 7.x).\n', 1, '2022-01-25 00:34:32'),
(255, 'DAVINCHI ', 'rrhh@davinchi.es', 'https://www.domestika.org/es/jobs/82591-desarrollador-a-angular-2-en-remoto', 'Trabajará online aunque puede trabajar también en nuestras oficinas de Las Rozas de Madrid (cuando la pandemia lo permita), sobre todo en la fase inicial de puesta al día del proyecto y en momentos concretos de seguimiento del mismo.\n\nTrabajamos por proyecto y el precio hora es 15-20€/hora en función de los conocimientos y experiencia. En cada tarea o proyecto se solicitará una estimación de las horas necesarias para su ejecución.\n\n- HTML5, CSS, Javascript ES6+\n- Control de versiones en GIT\n- Maquetación RWD (Responsive Web Design)\n- Typescript y Angular 2+\n- Que sea responsable, resolutivo y comprometido', 1, '2022-01-25 00:34:32'),
(256, 'Howland', 'info@howlandteam.es', 'https://www.domestika.org/es/jobs/82553-desarrollador-web-shopify-en-remoto', ' Experiencia demostrable en proyectos realizados con Shopify.\n- Facilidad de manejo e integración con APIs de Shopify y de terceros (ej: integración con almacenes...)\n- Experiencia avanzada en CSS3, HTML5 y Javascript.', 1, '2022-01-25 00:34:32'),
(257, 'resetbcnbyvitto', 'javascript@resetbcn.net', 'https://www.domestika.org/es/jobs/82068-programador-javascript-en-remoto', 'Tu trabajo sera básicamente Front-End y no te mentiremos, también algo de Back-End. Pero básicamente sera aplicar lo que los diseñadores hagan con Figma o XD, pasarlo a Front-End. NO ES SOLO UN CURRO DE MAQUETAICIÓN, es importante que lo tengas claro, También tocarás Back-End.\n\n', 1, '2022-01-25 00:34:32'),
(258, 'itSerra ', 'administracion@itserra.com', 'https://www.domestika.org/es/jobs/82014-desarrollador-a-web-en-remoto', '- Primer nivel de soporte: atenderá el buzón de soporte dónde los clientes envían peticiones de cambios de sus webs o incidencias.\n- Mantenimiento Web: se encargará de realizar el mantenimiento de las webs que tenemos.\n- Desarrollo: dependiendo de la experiencia y conocimientos aportados, la persona en cuestión llevará a cabo desarrollo de webs, tanto webs corporativas como tienda online según diseño. En itSerra no trabajamos basado en plantilla, o si las usamos son nuestras propias. Por lo que la persona que entre debe tener cuidado con el diseño para respetarlo al máximo posible.', 1, '2022-01-25 00:34:32'),
(259, 'Pau Penin ', 'job@paupenin.com', 'https://www.domestika.org/es/jobs/81478-web-developer-php-react-en-remoto', 'Buscamos un desarrollador web con conocimientos en stack LAMP:\n- HTML\n- CSS\n- JavaScript (jQuery, React, etc)\n- PHP\n- MySQL\n\nTrabajarás en frameworks tan diversos como:\n- Laravel\n- WordPress\n- PrestaShop\n- NodeJS\n\nAsí como en ', 1, '2022-01-25 00:34:32'),
(260, 'NSCORP España', 'mcseixas@nslab.me', 'https://www.domestika.org/es/jobs/80901-programador-web-en-remoto', 'Nuestro principal activo es el equipo de trabajo, por este motivo es esencial poder contar con profesionales de alto nivel técnico, apasionados para la tecnología y que estén plenamente motivados para crecer profesionalmente.\n\nActualmente buscamos incorporar un programador/diseñador WEB a nuestro equipo.\n\nImprescindible conocimientos en:\n- Programación Web.\n- Conocimientos PHP, JAVA, HTML5 y CSS\n- Integración de diseño web con código back-end.', 1, '2022-01-25 00:34:32'),
(261, 'Páginas Web Yá ', 'cv@paginaswebya.com.ar', 'https://www.domestika.org/es/jobs/78928-disenador-web-en-remoto', 'Páginas Web Yá busca un diseñador de páginas web en sistema Wordpress, con conocimientos en código HTML5, CSS, Javascript. Los proyectos serán administrados directamente por la persona seleccionada, quien deberá tener un contacto directo con el cliente. Se necesita experiencia en el manejo de campañas de Google Ads (no excluyente) y de publicidad en redes como Facebook e Instagram.\n\n', 1, '2022-01-25 00:34:32'),
