(264, 'Juega en tu Calle S.L. ', 'gonzalo@juegaentucalle.com', 'https://www.domestika.org/es/jobs/78018-web-developer-en-remoto', 'El visor web es una tecnología SPA (Single Page Application) ofrecida por Vue.js, y añadimos los estilos con Sass CSS. También usamos Webpack y Babel para la optimización de los recursos en producción y para aumentar la compatibilidad del código con distintos navegadores actuales.\n\nPara mostrar los mapas utilizamos las tecnologías de aceleración por GPU a través de WebGL que ofrecen las herramientas como Mapbox GL y CARTO-VL, con fuentes de datos GeoJSON y MVT, ofrecidas por los servicios de CARTO como la Maps API y la SQL API; siendo la segunda gestionada en nuestra propia API REST, que hace de intermediario y añade seguridad a las consultas.', 1, '2022-01-25 00:34:32'),
(265, 'Pearson Frank', 'l.landaluce@pearsonfrank.com', 'https://www.domestika.org/es/jobs/77787-php-developer-en-remoto', 'Para este nuevo año que entra, uno de nuestros clientes con producto propio implantado en las principales marcas sector retail, precisa la colaboración estable y a largo plazo de un desarrollador PHP para colaborar en el desarrollo del producto propio e implantación con clientes.', 1, '2022-01-25 00:34:32'),
(266, 'The Be Brand ', 'info@thebebrand.eu', 'https://www.domestika.org/es/jobs/77783-programador-full-stack-phyton-cassandra-en-remoto', 'Tenemos un equipo joven con amplia experiencia en múltiples tecnologías. Trabajamos con tecnologías como Phyton, Node.js, WebApps, Cassandra, mongoDB, PHP, MySQL con gran énfasis en el internet de las cosas y business intelligence.\n\nNuestra misión es ayudar a las empresas a resolver problemas empresariales usando el internet de las cosas. Por lo tanto, hacemos seguimiento del mundo físico, enviamos los datos al servidor, y los mostramos en una herramienta útil en la toma de decisiones.', 1, '2022-01-25 00:34:32'),
