(273, 'Infortec Consultores, S.A.U', 'empleo@infortec.net', 'https://infortec.ofertas-trabajo.infojobs.net/', 'Cuenta con un equipo de 700 profesionales, repartidos entre nuestras oficinas de Madrid, Barcelona, Sevilla, Ciudad de México y Santiago de Chile, altamente cualificados y con gran experiencia en el mundo de las nuevas tecnologías. Nuestro objetivo es ofrecer a nuestros clientes soluciones que pasan desde el outsourcing de servicios tecnológico digitales, pasando por la implantación de sistemas, plataformas y soluciones en la nube, así como el diseño de soluciones end to end mediante innovación abierta, apoyando a nuestros equipos con formación continua de alta calidad, las últimas herramientas y un plan de progreso para convertirlos en los líderes del mañana.', 1, '2022-01-25 00:34:33'),
