(287, 'Krell', 'info@consultingnormativo.es', 'https://www.tecnoempleo.com/krell-trabajo', 'Nuestra especialidad es aportar Soluciones de Negocio completas competitivas y de calidad al cliente tanto en la externalización del servicio en las TI como en su diseño construcción e implantación.\n\nNos encargamos de preparar a las empresas para que pueda desenvolverse sin problemas en el manejo de las tecnologías tanto en las tradicionales como en las más actuales e innovadores del momento. \n\nnumero de contacto: +34 914 117 037', 1, '2022-01-25 00:34:33'),
(289, 'Oxigent Technologies', 'contact@oxigent.io', 'https://www.tecnoempleo.com/python-developer-senior-100-en-remoto/python-erp-django-flask-varnish-redi/rf-95c0q7fbag5c0d9c37te', 'Las principales funciones serán:\n- Diseñar e implementar nuevas características a las aplicaciones web.\n- Diagnosticar y solucionar problemas en los servicios utilizados por millones de usuarios.\n- Evolutivos y correctivos sobre aplicaciones empresariales.\n\nPara ello, será necesario cumplir con los siguientes requisitos:\n- Experiencia de al menos 5 años con Python.\n- Experiencia en desarrollo de aplicaciones ERP, SGA o PIM.\n- Conocimientos de protocolos de comunicación básicos (REST, HTTP, FTP).\n- Experiencia con Django u otros frameworks.\n- Sistemas de caching (Redis, memcached o Varnish).\n- Conocimientos de SQL y NoSQL.\n\nnumero de contacto:\n+34 93 2715 800', 1, '2022-01-25 00:34:34'),
