(295, 'Serem', 'contacto@serem.com', 'https://www.tecnoempleo.com/desarrollador-wordpress-madrid/wordpress-php/rf-9135ea98ez031a30eezf', 'Requisitos:\n- Conocimientos de Wordpress y plugins de wordpress.\n- Experiencia en implantación de blogs basados en wordpress.\n- Experiencia en adaptación e instalación de plugins de funcionalidades para wordpress.\n- Conocimientos de phpbb3.\n- Experiencia en instalación de foros basados en phpbb3.\n- Conocimientos en tecnologías relacionadas: CSS, MySQL, PHP\n- Conocimientos a nivel de usuario del sistema operativo Linux.', 1, '2022-01-25 00:34:34'),
