(299, 'Novanotio', 'info@novanotio.es', 'https://www.tecnoempleo.com/novanotio-trabajo', 'Novanotio es una consultora sólida e innovadora dedicada a la Ingeniería Informática la Organización y los Recursos Humanos\n\nDesde 1995 opera en el ámbito nacional e internacional en los sectores de Tráfico Aereo Transporte Simulación Telecomunicaciones Banca y Audiovisual.\n\nLa plantilla formada por ingenieros el principal activo de Nova Notio desempeña su carrera profesional en diversos entornos multidisciplinares en constante evoclución y realizan proyectos de caracter innovador y de gran complejidad tecnologica.', 1, '2022-01-25 00:34:34'),
(300, 'Empatica.net', 'info@empatica.net', 'https://www.tecnoempleo.com/empatica-net/re-198870', 'empatica.net es una micro-pyme especializada en servicios de marketing digital y desarrollo de comercios electrónicos, páginas web corporativas y de captación de leads. esta formada por un equipo de 7 personas y ofrece sus servicios a pequeñas y medianas empresas de diferentes sectores.\n\ntlf:+34 626 45 51 80', 1, '2022-01-25 00:34:34'),
(301, 'Mutare', 'rrhh@mutare.es', 'https://www.tecnoempleo.com/mutare/re-182346', 'Transformacion (cultural, comunicación, sensibilización, organizaciones flexibles y productivas)\nTalento (formación, gestión del compromiso, desarrollo del talento)\nOptimizacion de procesos (business process outsourcing, recruitment process outsourcing, interim management, directivos/especialistas part time, apoyo administrativo\nSeduccion (head hunting especializado en recursos humanos)\n\notro correo:info@mutare.es', 1, '2022-01-25 00:34:34'),
(302, 'Ergeon', 'contact@ergeon.com', 'https://www.linkedin.com/jobs/view/javascript-software-developer-at-ergeon-2756445571/?trackingId=7vsEtoEgXXPAgQMxkiuPag%3D%3D&refId=UKT%2F5K0MWNYO8v68QzCerQ%3D%3D&pageNum=0&position=2&trk=public_jobs_jserp-result_search-card&originalSubdomain=ve', 'About Ergeon\n\nErgeon aims to become the #1 trusted provider of tech-enabled home improvement. This rapidly growing, $250B+ US market is hampered by many inefficiencies that create a stressful, time-consuming customer experience. As tech-powered pioneers in this space, we provide an amazingly better experience using software, data, and industry expertise.\n\nErgeon was founded and is run today by two CS serial entrepreneurs that share a deep passion for utilizing technology to improve how people work. We create innovative technologies that help consumers, contractors, and our all-remote staff excel.\n\nWe have a fast-growing and diverse team spread across 30+ countries today. We go to great lengths to ensure that our workforce, everywhere in the world, has access to career growth, an amazing work culture, and great benefits. Join us to revolutionize the construction industry!\n\nOverview Of The Role\n\nWe are looking for a smart and enthusiastic Javascript engineer to join our development team. Your primary focus will be the development of our 3d rendering tool. This includes working with our backend API, implementing 3d objects and textures, developing a friendly and responsive UI and ensuring the rendering engine has high performance and scalability. We\'re prioritizing finding someone who has the proven ability to learn quickly and the drive to do so.\n\nResponsibilities\nAdding support for new configurations in the existing engine.\nImproving existing procedural models and materials.\nImplementing new CAD tools and UI elements.\nAdding new products and features to the library.\nDeveloping algorithms for automation processes around the 3d objects.\n\nCompensation\nAnnual salary between $37-$50 thousand USD, depending on experience\n\nDesired Skills And Experience\n\nMust have\nExperience with Javascript\nExperience with ThreeJS\nEagerness to learn new things and able to do so quickly\nDeep care for user experience and producing high quality code\nStrong computer science fundamentals\nAvailability for sync meetings during the morning Pacific Time (6am-10am)\nComfortable working remotely with a distributed team\n\nNice to have\nDjango REST\nTypeScript\nExperience with 3D editors like Sketchup, Maya, 3ds Max\nExperience with React/Redux\nExperience working in a distributed team\nExperience with Scrum or other agile development process\n\nBenefits\nStock options\nFlexible paid time off (PTO)\n$200 reimbursed annually for learning, software/hardware or workplace improvements and fitness related spending\nHeadset reimbursement\nLaptop replacement of up to $2,000 reimbursed after 1 year of full time work and every 3 years after.', 1, '2022-01-25 00:34:34'),
(303, 'Darien Technology', 'contact@darient.com', 'https://www.linkedin.com/jobs/view/desarrollador-frontend-venezuela-at-darien-technology-2775163431/?trackingId=JpOyGTsyIXje45VeNnDTJg%3D%3D&refId=UKT%2F5K0MWNYO8v68QzCerQ%3D%3D&pageNum=0&position=3&trk=public_jobs_jserp-result_search-card&originalSubdoma', 'El Desarrollador debe estar preparado para crear y desarrollar sistemas funcionales que satisfagan las necesidades de nuestros clientes. Diseñando y desarrollando código con altos estándares de calidad, debidamente documentado y eficiente, siguiendo mejores prácticas y patrones de diseño.\n\nDispuesto a trabajar con equipos multidisciplinarios, usando metodologías ágiles.\n\n\nRequisitos\n\n\nExperiencia y conocimientos en la creación y edición de páginas web con\nHTML/CSS/JS\nJson\nNextjs\nReact\nGit\nScrum\nPostgreSQL/MySQL (deseable)\nCreemos en pensar diferente. Proporcionamos los mejores recursos del mercado para acompañar a nuestros clientes en su transformación digital. Nuestro ADN está conformado por constancia, compromiso, empatía y agilidad.\n\n¡Unete a nuestro equipo!\n\nInnovemos juntos ', 1, '2022-01-25 00:34:35'),
(304, 'Karyn Publicidad', 'info@karynpublicidad.com.co', 'https://www.ve.computrabajo.com/ofertas-de-trabajo/oferta-de-trabajo-de-programador-en-javascript-para-desarrollo-web-y-app-trabajo-remoto-en-caracas-49D775D5747ECE4F61373E686DCF3405?utm_campaign=google_jobs_apply&utm_source=google_jobs_apply&utm_medium=o', 'Descripción\nNecesito Programador JavaScript para Crear una web de Ajedrez Similar a\n\nchesscup org imprescindible saber jugar ajedrez\n\nTodo el trabajo se hará en VPS Linux. El pago se realizara al finalizar el trabajo Mediante la plataforma de Freelancer.\n\nSolo personas serias y conocimientos solidos en JavaScript y Mysql\nRequerimientos\nEducación Mínima: Educación Técnico/Profesional\n23 años de experiencia\nIdiomas: Español\nEdad: Hasta 60 años\nConocimientos: HTML, JavaScript, MySql\nDisponibilidad de Viajar: No\nDisponibilidad de Cambio de Residencia: No', 1, '2022-01-25 00:34:35'),
(305, 'AM Consultores Asociados SAC', 'contacto@amconsultores.com.pe', 'https://www.ve.computrabajo.com/empresas/ofertas-de-trabajo-de-am-consultores-asociados-sac-5B90954EDEFF2281', 'Desarrollador programador - en php Laravel\n\nDescripción\nAM CONSULTORES ASOCIADOS es una empresa peruana en desarrollo de sistemas y sitios web para empresas. Actualmente, estamos solicitando un programador de sistemas en PHP Laravel. Con los siguientes requisitos:\n\n1) Experiencia en más de 01 año en programación de sistema en PHP Laravel.\n\n2) Buen manejo de base de datos MySQL y PostgreSQL.\n\n3) capacidad de análisis y manejo de detalle en el desarrollo de interfaces de los sistema.\n\n4) Perseverante y buena comunicación en los proyectos.\nRequerimientos\nEducación Mínima: Educación Técnico/Profesional\n1 año de experiencia\nDisponibilidad de Viajar: No\nDisponibilidad de Cambio de Residencia: No\nPersonas con discapacidad: Sí', 1, '2022-01-25 00:34:35'),
(306, 'L.A SISTEMAS S.A.', 'soporte@lasistemas.com', 'https://www.ve.computrabajo.com/ofertas-de-trabajo/oferta-de-trabajo-de-programador-php-graduado-de-tsu-o-ingeniero-en-informatica-en-caracas-5A43E7F5B2E4DC4C61373E686DCF3405', 'Programador php - Graduado de TSU o Ingeniero en Informática\n\nDescripción\nNecesitamos un desarrollador con experiencia para apoyar en proyectos con las siguientes tecnologías:\n\n* PHP Avanzando (conocimiento POO), dominio de patrón MVC\n\n* Experiencia en HTML, CSS, Boostrap y Javascript (jQuery y AJAX)\n\n* Modelamiento de bases de datos relacionales, consultas, procedimientos almacenados y funciones en motores MYSQL\n\n* Desarrollo de tiendas virtuales, sistemas de gestión, control de datos y medios de pagos\n\n* Manejo de Git o SVN\n\n* Experiencia con PHP orientado a objetos\n\n* Manejo de Linux servidor web y línea de comandos (no excluyente)\n\n* Webservices y Microservices\n\n* Frameworks: Laravel (al menos 1 año de experiencia)\n\n* Vue con axios: para la reactividad de los sitios web con Laravel\n\nRequerimientos\nEducación Mínima: Universidad\n1 año de experiencia\nEdad: entre 22 y 30 años\nDisponibilidad de Viajar: Si\nDisponibilidad de Cambio de Residencia: No\nPersonas con discapacidad: Sí', 1, '2022-01-25 00:34:35'),
(307, 'Miguel_DEV', 'xp_92@mail.ru', 'https://www.aprendeaprogramar.com/mod/forum/discuss.php?d=6211', 'Mi nombre es Miguel, soy de Rusia. Soy programador, llevo estudiando web programación durante dos años. También estudio Español. Me gusta mucho esta lengua. Quero encontrar un programador principiante, para ayudarle en esta esfera. Yo sé: HTML5, CSS3, JavaScript, React JS, TypeScript, PHP, Laravel. También estudio react native y node js. Puedo ayudarle a persona que estudie FrontEnd. Todo será totalmente gratis. Sólo una persona, porque no tengo muchísima tiempo. Necesito practicar más mi Español. Tengo nivel aproximadamente B1. No soy profesor! No boy a explicar toda lengua de programación. Pero puedo ayudar con tema, que no entiendes. O ayudar encontrar error en tu aplicación. O ayudar realizar algo en tu codigo y etc. Por supuesto no soy experto en web y no estoy cerca, pero es suficiente para ayudar. No pierdes nada. Podré gastar tres horas a la semana. Es decir que ahorra preguntas y entonces nosotros llamamos y boy a contestarte. Sólo personas hispanohablantes, principales (no con nivel cero, porque necesitas estudiar por sí mismo desde al principio). Espero que no sea proivido ofrecer así en esta pagina. Si te enteresa, escribeme en mi correo electronico xp_92@mail.ru o xp92mg@gmail.com, mi pagina - wimdev.com. Disculpen por mis errores. Que tengan un buen día!', 1, '2022-01-25 00:34:35'),
(308, 'Construyo.website', 'comercial@grupoconstruyo.com', 'https://www.ve.computrabajo.com/ofertas-de-trabajo/oferta-de-trabajo-de-programador-junior-php-datatables-full-remoto-mysql-css-javascript-en-caracas-578FB14AAB07031861373E686DCF3405?utm_campaign=google_jobs_apply&utm_source=google_jobs_apply&utm_medium=o', 'Acerca de Construyo.website\nDesarrollamos páginas web baratas, porque todos podemos tener presencia en internet y formar parte del mundo 2.0, si eres una persona creativa, responsable, soñadora, comprometida, anímate y postúlate en tu área de conocimientos y forma parte de nuestro equipo', 1, '2022-01-25 00:34:35'),
(309, 'walmeric', 'people@walmeric.com', 'https://walmeric.com/oferta-empleo/oferta-programador-php-senior/', '¿Te gustaría desarrollar y optimizar nuevos productos tecnológicos? ¿Ser parte de proyectos que aplican últimas tecnologías y en un entorno ágil? Si tu respuesta es sí, el Dpto. de Producto e Innovación de Walmeric te está buscando para que te incorpores como Programador PHP Senior.', 1, '2022-01-25 00:34:35'),
(310, 'Sepalo', 'recursoshumanos@sepalo.es', 'https://sepalo.es/2021/04/14/oferta-empleo-programador-node-js-angular-javascript-2/', 'Si tienes excelentes capacidades de programación y eres un apasionado del desarrollo de aplicaciones o de la mejora de las existentes, nos gustaría conocerte.\n\nPerfil node.js / angular / javascript\n\nRequerido:\nExperiencia de al menos 2 años con aplicaciones node.js\nExperiencia con otros lenguajes javascript tipo:\nAngular\nAngularJS\nJavascript\nGIT y Gitflow\nMongoDB\nServicios REST\nDeseable\nPHP\nMySQL\nIONIC\nPentaho PDI\nIntegración continua con Gitlab-CI', 1, '2022-01-25 00:34:35'),
