(313, 'DevSense', 'info@devsense.io', 'https://www.tecnoempleo.com/desarrollador-web-senior-baleares/php-zend-framework-symfony-slim-framewor/rf-ba05605101359rf0b2p8', 'Experiencia relevante en el desarrollo de aplicaciones escalables en frameworks PHP comunes como Zend Framework, Symfony o el SlimFramework así como conocimientos profundos de POO y Patrones de Diseño\r\nExperiencia con bases de datos PostgreSQL y MySQL\r\nConocimientos sólidos de las tecnologías frontales (Javascript / Typescript / ES6, CSS) y marcos como React', 1, '2022-01-25 19:49:43'),
