(315, 'GESIO', 'info@gesio.com', 'https://www.tecnoempleo.com/programador-php-integraciones-alicante/php-javascript-ajax/rf-7047e3818ob6e1298cuc', '- Análisis y abstracción en BBDD. Trabajo en equipo. iniciativa y resolución de problemas.\r\n- Compromiso en la consecución de objetivos.\r\n- Programación: PHP, BBDD PostgreSQL, Diseño auxiliar en HTML. Javascript. JQuery. Ajax.\r\n- Plataformas: PHP sobre LINUX. Móviles Android, iOS (WEBAPPS)\r\n- Integraciones: API REST, JSON, SOAP. SDK IOS y ANDROID con Hardware\r\n- Idiomas: inglés para documentación y desarrollo.', 1, '2022-01-25 20:02:48'),
(316, 'Phoenix Connection', 'hello@phoenixconnection.es', 'https://www.tecnoempleo.com/desarrollador-senior-prestashop-100-en-remoto/prestashop-php-git-html-css-/rf-c74ds7891vb424fe44lb', '- Experiencia de 6 años o más en desarrollo PHP\r\n- Experiencia de al menos 4 años como desarrollador especialista Prestashop.\r\n- Experiencia en desarrollo de módulos y themes completos en Prestashop, versión 1.7\r\n- Experiencia avanzada en maquetación FrontEnd (HTML, CSS, JS)\r\n- Experiencia holgada utilizando GiT, realizado, merge request, creación de ramas, manejo de commits y resolución de conflictos.\r\n- Experiencia en integración de APIs', 1, '2022-01-25 20:14:38'),
(317, 'Optmedia', 'info@opt-media.net', 'https://www.tecnoempleo.com/programador-senior-barcelona/php-angular-ionic-nodejs-linux-ubuntu/rf-e2b4y329bw3d0ned5dc7', 'Estamos buscando un programador para incorporar a nuestro equipo de desarrollo web de forma inmediata para el desarrollo de apps, funcionalidades web y gestión de servidores por SSH.\r\n', 1, '2022-01-25 20:18:04');
