(318, 'ProfesorCBD', 'hello@profesorcbd.com', 'https://www.tecnoempleo.com/woocommerce-developer-madrid/woocommerce-php-html-css-javascript-google-ta/rf-51bda4b56ce40n254fp9', 'Desarrollo de sitios web corporativos y portales de ecommerce para los verticales de la empresa.\r\nMantenimiento y soporte de las páginas web y portales ecommerce de los verticales de las marcas de la empresa.\r\nModificación HTML/CSS, Custom Post Types, Custom Fields, personalización de temas, pasarelas de pago y plataformas de envío, etc\r\nMantenimiento y gestión de Google Tag Manager y Google Analytics.\r\nMantenimiento de la base de datos y tratamiento de ficheros.\r\nIntegraciones con el resto de softwares y plataformas analíticas de la empresa.\r\nControl de procesos/fallos y creación de protocolos técnicos\r\nCreación de webs y landings con Webflow.', 1, '2022-01-25 20:21:56'),
(319, 'Blarlo', 'hola@blarlo.com', 'https://www.tecnoempleo.com/programador-senior-php-alicante/php-mysql/rf-a524kf1f4de3ey2ebf01', 'Un buen programador PHP, con conocimientos sólidos de SQL.\r\nAunque el trabajo es mayormente backend, también es necesario conocer HTML, CSS (o scss) y un poquito de Javascript pues te tocará montar alguna pantalla.', 1, '2022-01-25 20:30:21'),
(320, 'GETIC', 'info@getic.mx', 'https://www.tecnoempleo.com/desarrollador-100-en-remoto/php-javascript-html-css-jquery-bootstrap-json/rf-779bk32cf034azf906n3', 'Experiencia mínima: 1 año en los siguientes conocimientos\r\n- PHP, JavaScript, HTML, CSS, JQuery, Bootstrap, JSON\r\n- Base de datos SQL Server\r\n- Opcional: Angular, PostgreSQL, NoSQL, Kotlin, Node.js, Python, C#, Java, MYSQL', 1, '2022-01-25 20:34:05'),
(321, 'Gobalo Studio', 'hola@gobalo.es', 'https://www.tecnoempleo.com/full-stack-developer-100-en-remoto/jquery-angularjs-html-css3-mvc-poo/rf-dc89c9336b960t1d57w7', 'Experiencia, de mínimo 3 años, como full stack developer que sepa desenvolverse tanto en Front-End como en Back-End.\r\nFront-End:\r\nAmplio conocimiento de Javascript, con uso de frameworks como jQuery, AngularJS, etc.\r\nExperiencia con HTML, CSS3 y responsive.\r\nExperiencia en el uso de frameworks CSS como Bootstrap.\r\nExperiencia en desarrollo orientado a SEO.', 1, '2022-01-25 20:55:38'),
(322, 'Sdweb Innovative Digital Solutions', 'info@sdweb.es', 'https://www.tecnoempleo.com/disenador-web-frontend-developer-a-coruna/html-css-photoshop-gimp-illustra/rf-c5efc8a1cr0afe36cdm9', 'Valoraremos muy positivamente la inquietud, el conocimiento y/o la experiencia en Photoshop/Gimp, Illustrator, HTML5, CSS, Javascript, JQuery, y Bootstrap; así como los conocimientos adicionales que se puedan aportar de PHP, LAMP, y/o Wordpress o Drupal; y sobre todo lo anterior, las ganas y actitud para trabajar en equipo.\r\n', 1, '2022-01-25 20:57:48'),
(323, 'Responsables', 'info@responsables.cat', 'https://www.tecnoempleo.com/desarrolladores-as-web-100-en-remoto/web/rf-cba03c232v038ud66ap5', 'Te ofrecemos un itinerario de entrada al sector de desarrollo web: Certificado de profesionalidad completo sobre desarrollo y mantenimiento de páginas web (480 horas) + PRÁCTICAS en empresa + CONTRATO laboral como desarrollador web.\r\n', 1, '2022-01-25 21:06:33'),
(324, 'icode consultors', 'soporte@icode.es', 'https://www.tecnoempleo.com/tecnico-informatico-barcelona/windows-office-redes-ordenadores-perifericos/rf-eece5485ct84ec6e32t3', '- Conocimientos técnicos de microinformática y soporte a usuarios Windows. Se valorará además, Mac.\r\n- Proactividad y autonomía en la resolución de incidencias técnicas.\r\n- Persona ordenada y responsable.\r\n- Buena presencia y trato con el cliente.\r\n- Carné de conducir.\r\n- Catalán', 1, '2022-01-25 21:10:36'),
