(327, 'Smarter Solutions C.A', 'contacto@smarter.com.ve', 'https://ve.whatjobs.com/Trabajo-para-Desarrollador-Web-PHP-en-caracas-coop236789', 'En Samrter Solutions Somos una organización multinacional en el área de tecnología con 11 años en el mercado, y con representación en 3 países del mercado Iberoamericano. Nos encontramos en la búsqueda de un Desarrollador Web PHP. Los objetivos para este cargo son: Analizar, diseñar, codificar, probar y documentar requerimientos funcionales que conforman la solución de una plataforma WEB demandada por un cliente. En lenguaje PHP, bajo en framework Symfony y AngularJS.\r\nPerfil:\r\nIngeniero, Licenciado o TSU en informática\r\n2 o 3 años de experiencia en el área\r\nManejo del idioma inglés intermedio\r\nCon conocimientos en:\r\n- Jquery\r\n- Javascript\r\n- Maquetado web (CSS, Less, Sass, Html)\r\n- Control de Versiones (git, gitflow)\r\n- Manejo de Frameworks de desarrollo Symfony 2.1+\r\n- PHP 5.0+ (Orientado a Objetos)\r\n- Desarrollo orientado a servicios(Rest / RestFull)\r\n- ORM Doctrine\r\n- MySQL\r\n- Definicion de consultas con estándar SQL\r\n- Apache\r\nSi cumples con el perfil, no dudes en postularte, ¡te estamos esperando!\r\n', 1, '2022-01-25 21:34:58'),
(328, 'Bumerang Takeaway SL', 'info@youbumerang.com', 'https://www.domestika.org/es/jobs/91546-front-end-mobile-developer-en-remoto', 'Buscamos un desarrollador de apps móviles con experiencia en React, React Native y Ionic. Trabajarás junto al equipo tech compuesto por un desarrollador backend senior y un desarrollador frontend junior.\r\n\r\n', 1, '2022-01-26 16:11:42'),
