(3144, 'SimTLiX', 'jobs@simtlix.com', 'https://www.linkedin.com/jobs/view/2902716517/?alternateChannel=search&amp;refId=N5Fa5n9Pk4afuD1SE80xQQ%3D%3D&amp;trackingId=b8dLJRN97gr6bKW6EFSNLw%3D%3D', 'As a result, SimTlix developed into an organization that has a very strong focus on technology innovation with leading world-class processes to productize such ideas and provide our customers with a truly simple yet powerful service.\r\n', 1, '2022-02-02 17:40:24'),
(3145, 'OcasionPlus', 'paz.aramburu@ocasionplus.com', 'https://www.domestika.org/es/jobs/91733-desarrollador-frontend-senior-en-remoto', '- 4-5 años de experiencia como Frontend Developer.\r\n- 3 años de experiencia demostrable con React, Redux y Webpack.\r\n- 2 años de experiencia profesional demostrable con algún precompilador de CSS como SASS o LESS.\r\n- Dominio nivel experto de HTML5 y CSS3.', 1, '2022-02-02 18:26:00'),
(3146, 'Dimension Four', 'hello@dimensionfour.io', 'https://landing.jobs/at/dimension-four/front-end-developer-in-oslo?country=NO', 'React / React Native\r\nTypescript\r\nNextJS, NodeJS / VueJS/ Express\r\nGraphQL\r\nMongoDB', 1, '2022-02-02 18:29:46'),
(3147, 'TECDATA ENGINEERING', 'rrhh@tecdata.es', 'https://www.infojobs.net/madrid/programmer-analyst-web-javascript/of-icebd2d0f21417089346b58cfcb2f8e?applicationOrigin=search-new&amp;page=1&amp;sortBy=RELEVANCE', 'Estamos buscando un perfil Programmer analyst Web Javascript con experiencia en:\r\nFunciones:\r\n\r\nSoporte a los sistemas de producción, manejo de incidencias y mantenimiento de sistemas de Front End existentes\r\nTecnologías obligatorias: Javascript, HTML, .net y Oracle nivel intermedio .\r\nInglés: B2 o superior', 1, '2022-02-02 18:50:41'),
(3148, 'Abalia', 'info@abalia.com', 'https://www.infojobs.net/madrid/programador-javascript-teletrabajo/of-ie5c4d7d74d484597af36a4e3dee024?applicationOrigin=search-new&amp;page=1&amp;sortBy=RELEVANCE', '- Experiencia en desarrollo front end JavaScript, HTML, CSS, JQuery.\r\n- Experiencia en edición de video.\r\n\r\nValorable:\r\n-Experiencia en testing con Karma, Jasmine o similar.\r\n- Experiencia en proyectos con metodología Agile.\r\n\r\nTambién contamos con proyectos en remoto de React y JS.\r\n\r\nNo dudes en inscribirte si encajas en alguno de los perfiles, ¡te esperamos!', 1, '2022-02-02 18:57:11'),
(3149, 'SEBASTIÁN CONSULTORES', 'jorge.sebastian@sebastianconsultores.com', 'https://www.infojobs.net/alcobendas/javascript-es6-react-developer-cliente-final-jornada-intensiva/of-i6d3a6f29e84f9c8bdfe0a95255556f?applicationOrigin=search-new&amp;page=1&amp;sortBy=RELEVANCE', 'Experiencia de, al menos, 1 año en desarrollo de las funciones descritas con dominio de:\r\n- Desarrollo de SPA con React JS.\r\n- Experiencia con HTML5 y CSS3.\r\n- Programación con JavaScript ES6.', 1, '2022-02-02 19:06:22'),
(3150, 'Frogtek España', 'info@frogtek.org', 'https://www.infojobs.net/zaragoza/programador-web-vuejs-100-remoto/of-i66d1d80a9c4e008e3e848328de0d93?applicationOrigin=search-new&amp;page=2&amp;sortBy=RELEVANCE', '- Como es obvio hay que tener experiencia demostrable de varios años en el desarrollo front-end con VueJS preferiblemente usando frameworks como Vuetify, Quasar u otros. ¡Nos encantaría ver ejemplos de apps que hayas hecho!\r\n- Usaremos Electron para construir los nuevos productos, así que tener experiencia con él y conocerlo es algo que valoraríamos positivamente.\r\n- Esperamos que, como es lógico, controles en profundidad tecnologías como HTML, JavaScript, CSS y que sepas maquetar...\r\n- Nuestras soluciones trabajan con datos de manera intensiva, así que es importante también conocer SQL, saber manejar bases de datos cifradas, ser capaz de hacer optimizaciones básicas de consultas...', 1, '2022-02-02 19:15:07'),
(3151, 'CLIKALIA', 'hola@clikalia.com', 'https://www.infojobs.net/madrid/senior-nodejs-developer/of-id25c537ed84faf8ba7358ca541a790?applicationOrigin=search-new&amp;page=3&amp;sortBy=RELEVANCE', 'Nos sentimos muy orgullosos de lo que estamos haciendo, tenemos un propósito y hay hueco para el talento. Queremos integrar el mejor equipo para cambiar la forma en que se vende o se compra tu casa. Nos esforzamos cada día en ofrecer un entorno de trabajo inspirador y que motive a nuestro principal activo: las personas.\r\n\r\n- 23 días de vacaciones\r\n- Puesto de trabajo mixto remoto/presencial (2/3)\r\n- Equipo a tu elección Windows/Mac/Linux\r\n- Horario flexible orientado a objetivos', 1, '2022-02-02 19:42:20'),
(3152, 'Customer Service', 'info.mexico@cuservi.com', 'https://www.infojobs.net/customer-service/em-i66544948565650671171150008246645915538', 'Para ampliar nuestro departamento de IT, a un Analista programador, con amplios conocimientos en programación, especialmente en lenguaje PHP y PHP LARAVEL, GIT, HTML5, jAVASCRIPT (JQUERY), CSS3 (FRAMEWORK BOOTSTRAP), MYSQL, con inglés fluido, tanto hablado como escrito, para contactar con nuestros clientes para futuras implantaciones o modificaciones actuales.\r\nFacilidad de trabajar en equipo.\r\nCon conocimientos en eCommerce.\r\nFacilidad de adaptación a las nuevas tendencias gráficas y de programación.', 1, '2022-02-02 19:48:04'),
(3153, 'Bilbomática', 'lopd@bilbomatica.es', 'https://www.infojobs.net/a-coruna/desarrollador-senior-ingeniero-software/of-ib139342e624b2bbffe91f203c1e826?applicationOrigin=search-new&amp;page=3&amp;sortBy=RELEVANCE', '1. Conocimientos de patrones de diseño y programación orientada a objetos.\r\n2. Dominio de algunos de los artefactos y tecnologías de las siguientes áreas:\r\n- Gestión de bases de datos: Microsoft SQL Server/ PostgreSQL/ Oracle.\r\n- Lenguajes y frameworks de programación front-end: HTML, CSS y JavaScript.\r\n- Lenguajes y frameworks de programación back-end: .NET Core, Python, Scala, R, Java.\r\n- Repositorios de control de código: Subversion, Git, GitHub o Azure DevOps.\r\n- Software de colaboración en equipo: Jira/ Confluence / Redmine.\r\n3. Conocimientos de algún framework ágil, por ejemplo, SCRUM o Kanban.\r\n4. Muy buen dominio del inglés: oral y escrito (B2 - C1).', 1, '2022-02-02 19:53:57'),
(3154, 'Català HR-IT Search', 'cv@catalarrhh.es', 'https://www.infojobs.net/cornella-de-llobregat/angular-developer/of-i69d67d7e4e437d8b7df6c2bb3fdf75?applicationOrigin=search-new&amp;page=4&amp;sortBy=RELEVANCE', 'Se valorará conocimiento en JavaScript.\r\n\r\nBuscamos un/a profesional con 2-3 años de experiencia profesional que quiera formar parte de una gran empresa y con la oportunidad de aprender en un equipo IT multidisciplinar.\r\n\r\nRequisitos:\r\n\r\nPersona proactiva, dinámica y resolutiva.\r\nCon inquietudes por aprender y aportar su conocimiento.\r\nTrabajo en equipo.\r\nExperiencia en soporte al cliente u usuario interno.', 1, '2022-02-02 20:05:07'),
(3155, 'SABIA Personal', 'recruitment@sabiapersonal.com', 'https://www.infojobs.net/donostia-san-sebastian/desarrollador-full-stack/of-i9d897f01d84fbdaf087fac8c985d36?applicationOrigin=search-new&amp;page=4&amp;sortBy=RELEVANCE', '¿Qué necesitamos?\r\n1. +1 año de experiencia demostrada como programador de aplicaciones web y/o para móviles orientada a objetos.\r\n2. Desarrollando en alguna/s de esta/s tecnología/s:\r\n- JavaScript\r\n- Html y CSS\r\n- PHP\r\n- TypeScript\r\n- BBDD SQL\r\n- NodeJS\r\n3. Valoraremos uso/conocimientos de Git y Visual Studio Code\r\n4. Titulación igual o superior a FP Grado Superior Técnico superior en desarrollo de aplicaciones multiplataforma y/o web.', 1, '2022-02-02 20:13:12'),
(3156, 'RLE INTERNATIONAL IBERIA SL.U', 'info@rleiberia.es', 'https://www.infojobs.net/valencia/desarrollador-apps/of-i136c6bc38141959e250aecaca48250?applicationOrigin=search-new&amp;page=5&amp;sortBy=RELEVANCE', '· Programación de aplicaciones para dispositivo Android nativo en java y/o kotlin.\r\n· Conocimientos en APIs para comunicación/consultas con servidores en cloud.\r\n· Conocimientos de bases de datos SQL y NoSQL\r\n· Inglés fluido hablado y escrito.\r\n\r\nConocimientos valorables:\r\n\r\no Programación de aplicaciones móviles multiplataforma - Flutter.\r\no Experiencia en UI/UX. (DISEÑO INTERFACES)\r\no Programación de microcontroladores.\r\no Lenguajes de programación Python, C, C++ y javascript.\r\no Programación de aplicaciones web en la parte de Front-end y\r\nBack-end.\r\no Conocimientos en ciberseguridad.\r\no Conocimientos de servidores en cloud.', 1, '2022-02-02 20:38:27'),
(3157, 'Zasylogic', 'comercial@zasylogic.com', 'https://www.tecnoempleo.com/desarrollador-asp-net-tecnologias-web-madrid/asp-net-web-javascript-asteri/rf-7944z0405a01exc4e7b5', 'Requisitos:\r\n•Experiencia mínima: al menos 3 años de experiencia demostrable en las tecnologías solicitadas. Evaluación mediante prueba de nivel escrita y entrevista personal.\r\n•Persona muy capaz, con iniciativa y resolución, que sepa integrarse en un equipo de trabajo y que, aun con su autonomía, reporte directamente al equipo y al Director de IT/SaaS\r\n•Capacidad de comunicación y visión compartida\r\n•Requisitos deseados: Orientación de objetivos, metodología en gestión de proyectos y documentación\r\n•Dedicación exclusiva para un puesto operativo con desarrollos y proyectos\r\n•Abstenerse candidatos que no cumplan los requisitos\r\n\r\n', 1, '2022-02-02 20:44:35'),
