(5762, 'Anansi', 'hello@withanansi.com', 'https://landing.jobs/at/anansi/senior-software-engineer-in-2021-11?country=', '4+ years of professional Software Engineering Experience\r\nExperienced in Python\r\nExposure to a front-end technology\r\nExperience in building robust micro-services\r\nExperience in managing a CI/CD pipeline\r\nUsed to working with relational databases\r\nGood communication in English\r\nYou live in Portugal, UK, Spain or Germany.\r\nPlease no agencies', 1, '2022-02-03 23:38:38'),
(5763, 'ADDCOMM DIRECT SLU', 'info@addcomm.nl', 'https://www.infojobs.net/marbella/php-web-developer/of-i42fc3ce227456f9ffbdafbfab0276c?applicationOrigin=search-new&amp;page=1&amp;sortBy=RELEVANCE', '- Have at least 2 years of web development experience.\r\n- Good PHP development experience\r\n- Knowledge in MySQL/MARIA DB - Modern database development experience.\r\n- Experience as a Full stack developer.\r\n- Understand and apply Object Oriented Development\r\n- Experience in building Web Services\r\n- Familiar with MVC framework\r\n- A well-motivated Self-Starter with good communication skills\r\n- High level of English in speaking, reading, and writing.', 1, '2022-02-04 18:09:50'),
(5764, 'Lantek Sheet Metal Solutions Sl', 'sales.uk@lanteksms.com', 'https://www.infojobs.net/bilbao/web-developer-vitoria-bilbao/of-id303f284aa47849943b255399d8de8?applicationOrigin=search-new&amp;page=1&amp;sortBy=RELEVANCE', '¿QUÉ NECESITAMOS DE TI?\r\n\r\nPara cubrir esta posición pensamos en un perfil con:\r\n\r\n- Formación técnica en Ingeniería Informática, Telecomunicaciones y/o disciplinas afines. Se valorarán también perfiles con Grados en Ciencias Físicas o Matemáticas, pero con su experiencia dirigida al Desarrollo de Software.\r\n- Al menos 2 años de experiencia en la programación de aplicaciones web tanto front-end como back-end.\r\n- Se valorará también conocimientos en (No es imprescibdible dominar todas las tecnologías):\r\n* Microsoft Azure, Amazon AWS o Google Cloud\r\n* HTML5, CSS\r\n* Bases de datos: SQL Server, MySQL\r\n* Lenguajes de programación: C#, Java\r\n* Frameworks de programación: .NET, ASP.NET Core, Node.js,\r\n* Angular, React\r\n* Integraciones e API RESTful (JSON), Web Services\r\n* Métodologías ágiles: SCRUM\r\n* Testing\r\n- Se valorará nivel avanzado de inglés.\r\n- Capacidad de trabajo en equipo, organización, autonomía en la toma de decisiones y resolución de problemas.', 1, '2022-02-04 18:13:30'),
(5765, 'PAR INNOVATIONS S.L.', 'info@par-innovations.com', 'https://www.infojobs.net/almeria/net-software-developer/of-iad5e8706194142880c43cb75e18cca?applicationOrigin=search-new&amp;page=1&amp;sortBy=RELEVANCE', 'Solid knowledge of C# / .NET programming language and MSSQL\r\nUnderstanding of client/server architecture, .NET socket programming, WEB- and REST-services\r\nAble to work with Git version control system\r\nWindows server , IOT and Linux admin basics\r\nEnglish level B2', 1, '2022-02-04 18:49:53'),
(5766, 'Montarelo Consulting S.L.U.', 'info@montareloconsulting.com', 'https://www.infojobs.net/madrid/senior-python-developer-madrid-parcialmente-remoto/of-i9a06822e0c4087be758887f1a9c2a6?applicationOrigin=search-new&amp;page=1&amp;sortBy=RELEVANCE', 'Requisitos mínimos\r\nPersonal skills:\r\n· You have Strong analytical and problem-solving skills.\r\n· Team oriented, Collaborative and easy to deal with.\r\n· Proactive and independent working.\r\n· Great willingness to learn, creativity, reliability as well as commitment.\r\n· Disruptive, creative, out of the box thinking.\r\n· Strong communication skills.\r\n· Client focused.\r\n\r\nEducation and Training:\r\n· Technical training (advanced technical college, university of applied sciences or technical university) or relevant related experience', 1, '2022-02-04 22:50:25'),
(5767, 'Bureau Veritas', 'infoesp@bureauveritas.com', 'https://www.infojobs.net/madrid/business-developer-sector-fotovoltaico/of-ie33352d05041b48b0724ecf4266a54?applicationOrigin=search-new&amp;page=1&amp;sortBy=RELEVANCE', 'Licenciatura técnica.\r\n· Mínimo 2 años de experiencia en estudios técnicos o asesoría en instalaciones fotovoltaicas (en suelo y azotea).\r\n· Conocimiento y acceso a clientes sectoriales (tanto desarrolladores, clientes finales como proveedores de tecnología).\r\n· Buenas habilidades interpersonales (comunicación y atención al cliente).\r\n· Disponibilidad a viajar\r\n· Inglés (mínimo B2).\r\n· Conocimiento de aplicaciones CRM (valioso).', 1, '2022-02-04 23:08:23'),
(5768, 'Aplicaciones Tecnológicas, S.A.', 'atsa@at3w.com', 'https://www.infojobs.net/paterna/business-developer/of-i75db86db7e4257ae24799bc17d40ef?applicationOrigin=search-new&amp;page=1&amp;sortBy=RELEVANCE', '-Estudios Técnicos de Grado (Arquitectura, Ingeniería Técnica, Edificación y Obra Civil...) o Estudios de Administración de Empresas, Comercio Internacional.\r\n- Nivel Alto de Inglés\r\n- Experiencia Comercial', 1, '2022-02-04 23:16:48'),
