(6023, 'Vipirsa', 'info@vipirsa.com', 'https://www.infojobs.net/madrid/lider-proyecto-javascript-react-web-azure-devops-madrid-remoto/of-i48c806b73744ae89e64ee4fcc6570f?applicationOrigin=search-new%7Celement%7E43630715860&amp;searchId=43630715860&amp;page=1&amp;sortBy=RELEVANCE', 'Requisitos Tecnológicos: Typescript (nivel experto), Javascript (nivel experto): domina la mayor parte de las características de ES5 y ES6. HTML (nivel avanzado), CSS (nivel medio), SASS/SCSS (nivel básico): conoce la nomenclatura BEM. Frameworks: · Angular (nivel experto): sabe cómo utilizar la inyección de dependencias, domina cuándo utilizar una Pipe, un Componente, un Módulo, etc. .. Conoce estrategias de gestión de estados. · React y Vue: valorable. Otras herramientas/tecnologías: GIT (nivel avanzado): necesario que sepa trabajar con las acciones más comunes de git, gitflow. Jenkins/Github actions (nivel medio), Azure devops... Sonar (nivel básico).', 1, '2022-02-10 14:32:23'),
