(6026, 'Netberry Solutions', 'helena.pascual@netberry.es', 'https://www.netberry.es/ofertas-empleo/', 'Seleccionamos a un perfil de desarrollo Java, y que cuente también con algo de experiencia con C++ (imprescindible para el puesto). La mayor parte del tiempo, casi toda, se dedicará a desarrollar proyectos web con java, pero en alguna ocasión habrá que modificar una aplicación cuando esta requiera cambios.\r\n\r\nLa persona seleccionada se incorporará al equipo de desarrollo del cliente, siendo en remoto a largo plazo.\r\n\r\nTecnología requerida:\r\n\r\nJava, Spring, Springboot, Rest, SQL, JPA e Hibernate.\r\nC++, PL/QSL, Linux, Oracle, Soap\r\nSe valorará positivamente contar con una formación en ingeniería informática o del software, pero no es imprescindible. Así como profesionales proactivos, comprometidos/as, y que trabajar en equipo sea un valor fundamental.\r\n\r\nSector: Retail\r\n\r\nHorario: de lunes a jueves entrada flexible desde las 08:30h y salida en función de la entrada. Los viernes de 08h a 16h. Jornada intensiva de mes y medio en verano.\r\n\r\nTipo de contrato indefinido.\r\n\r\nSalario: a convenir según experiencia aportada.', 1, '2022-02-10 15:03:47'),
