(6032, 'PS LAB CONSULTING', 'info@ps-lab.net', 'https://www.infojobs.net/madrid/programador-php-contratacion-directa-cliente-final/of-i85710937d54841995d51e2562e31f1?applicationOrigin=search-new%7Celement%7E43631036240&amp;searchId=43631036240&amp;page=1&amp;sortBy=RELEVANCE', 'Las aptitudes deseadas son disponer de al menos 2 - 3 años de experiencia como Programador con experiencia en:\r\n- Programación con PHP.\r\n- Experiencia con el Framework Symfony.\r\n- Valorable experiencia con JavaScript, HTML, CSS.\r\n- Bases de Datos MySQL.\r\n- Apis.\r\n- Control de versiones GIT.\r\n- Gestión de tareas con Jira.\r\n- Metodología ágil Scrum.\r\nSalario entre 38.000 - 45.000 euros bruto al año en función de la experiencia aportada.', 1, '2022-02-14 14:29:20'),
(6033, 'Genco Pura Studio', 'rrhh@gencopura.es', 'https://www.domestika.org/es/jobs/92094-desarrollador-web-madrid-espana', '* Entre 2 y 3 años de experiencia en otro puesto de similar responsabilidad y funciones.\r\n* Dominio de los CMS Wordpress y Prestashop.\r\n* Valorable conocimiento básicos de Magento 2.\r\n* Capacidad para migrar entre entornos de producción y \"staging\", copias de seguridad y despliegue de los CMS en los hosting propios o de cliente.\r\n* Cuidado por los detalles en el desarrollo mobile y desktop multidispositivo.\r\n* Conocimientos PHP y Javascript para modificar o programar pequeñas cuestiones que necesite personalizar el cliente.\r\n* Creación de landing pages.\r\n* Valorable conocimiento de herramientas de prototipado.\r\n* Perfil eficiente, eficaz, pro-activo y muy responsable con el trabajo. Trabajamos por objetivos, orientados a resultados.\r\n* Control total de las páginas web contratadas por el cliente.\r\n* Capacidad de adaptación a las peticiones de cliente, nuevas funcionalidades y tecnologías.\r\n* Buen gusto y sentido de la estética visual bien desarrollado y actual.\r\n* Amante del detalle y la perfección.', 1, '2022-02-14 14:40:53'),
