(6035, 't2k', 'trabajo@t2k.es', 'https://www.domestika.org/es/jobs/92041-disenador-web-madrid-espana', 'Trabajarás en el departamento de Diseño y Desarrollo Web. Tu principal función será la de diseñar y construir páginas web nuevas o modificar y mantener las existentes.\r\nAdemás, servirás de refuerzo al área de diseño gráfico, con el que podrás colaborar a la hora de diseñar materiales de comunicación y marketing\r\n\r\n• Que buscamos\r\n\r\n- Experiencia en creación /modificación de plantillas Wordpress\r\n- Experiencia en eCommerce (Woocommerce)\r\n- Código orientado al SEO y velocidad de carga.\r\n- Conocimientos y manejo de servidores\r\n- Habituado al uso de Adobe Suite – Photoshop, Illustrator, Adobe XD, Premiere\r\n- Experiencia en el manejo de herramientas colaborativas para la gestión del día a día\r\n- Nivel alto de Inglés.', 1, '2022-02-14 14:45:52'),
(6036, 'rwbcn@robertwalters.com', 'rwbcn@robertwalters.com', 'https://www.infojobs.net/valencia/javascript-developer-remote/of-i032eb2ef064a85987613806c7b341c?applicationOrigin=search-new%7Celement%7E43630715860&amp;searchId=43630715860&amp;page=1&amp;sortBy=RELEVANCE', '-Conocimientos de JavaScript\r\n- Manejo de HTML y CSS\r\n- Framework de desarrollo Vue preferiblemente.\r\n- Trabajo con metodologías ágiles\r\n\r\nSe ofrece:\r\n- Contrato indefinido\r\n- Posibilidad de teletrabajo\r\n- Salario según valía\r\n- Formación a cargo de la empresa', 1, '2022-02-14 22:16:17'),
(6037, 'Cobser Consulting', 'comercial@cobser.es', 'https://www.infojobs.net/madrid/desarrollador-java-javascritp-qa-tester-automation-cypress-ingles/of-i7335f6cd2740b2821dd73e8f0af69f?applicationOrigin=search-new%7Celement%7E43630715860&amp;searchId=43630715860&amp;page=1&amp;sortBy=RELEVANCE', 'Se requieren 2 años de experiencia en programación: Java , Front - JavaScript\r\nSe valorará la experiencia en testing - Test automaticos con Cypress\r\nInglés alto a nivel conversacional / no es necesario bilingüe pero si recibirá información y deberá participar en reuniones en Inglés.\r\nProyecto de larga duración,\r\nPosibilidad de participar y crecer.', 1, '2022-02-14 23:18:04'),
(6038, 'LEEMON', 'hola@leemon.es', 'https://www.infojobs.net/sevilla/especialista-seo-content-wordpress/of-i7b3ee58b0440288c243c35f9e74c90?applicationOrigin=search-new%7Celement%7E43667920820&amp;searchId=43667920820&amp;page=1&amp;sortBy=RELEVANCE', '-Dominio de WordPress\r\n- Conocimientos de SEO de contenidos\r\n- Capacidad lectora/redacción absoluta\r\n- Dominio de las redes sociales\r\n- Conocimientos de Optimización SEO\r\n- Keyword research\r\n- Diseño web (imprescindible nivel avanzado de Wordpress y elementor)\r\n- Capacidad de planificar y aplicar una estrategia SEO a una web\r\n- Linkbuilding y compra de enlaces\r\n- Canva\r\n- Experiencia en un puesto similar\r\n- Hostuite\r\n\r\nSe valora muy positivamente:\r\n- Conocimientos de programación (HTML, CSS, PHP)\r\n- Edición de vídeos (adobe premiere pro)\r\n- Publicidad SEM\r\n- Publicidad en redes sociales', 1, '2022-02-14 23:25:32'),
(6039, 'Fuerte Group Hotels', 'rrhh@fuerte-group.com', 'https://www.infojobs.net/marbella/maquetador-web-con-wordpress/of-ib3a5de951f45878deb227785b14bb3?applicationOrigin=search-new%7Celement%7E43667920820&amp;searchId=43667920820&amp;page=1&amp;sortBy=RELEVANCE', 'Requisitos Maquetación web\r\n- Desarrollo de sitios web con WordPress\r\n- Maquetación HTML5 y CSS3\r\n- Visual Composer\r\n- WPBakery Page Builder\r\n- Elementor\r\n- Pixel Perfect\r\n- SEO básico\r\n- Optimización de rendimiento web (WPO)', 1, '2022-02-14 23:31:01'),
(6040, 'Mojito360', 'support@mojito360.com', 'https://www.domestika.org/es/jobs/92102-disenador-a-web-valencia-espana', '- Maquetación HTML/CSS.\r\n- Experiencia en Wordpress.\r\n- Diseñador de prototipos, wireframes y mockups para nuestra plataforma.\r\n- Diseño de recursos gráficos para los distintos soportes de comunicación ( Landing pages, presentaciones, newsletters, banners...).\r\n- Base sólida de diseño UX/UI.\r\n- Dominio de Herramientas de diseño: Figma, Photoshop, Illustrator...', 1, '2022-02-14 23:34:15'),
(6041, 'CONVERSA CONSULTORES', 'info@conversaconsultores.info', 'https://www.tecnoempleo.com/programadores-pl-sql-madrid/pl-sql-sql/rf-a8c6g449fhf03y1d84h3', 'Dentro del equipo de Desarrollo será responsable del mantenimiento, modificaciones y ampliaciones de las aplicaciones informáticas, así como implantación de nuevos proyectos en Lenguaje PL/ SQL.\r\nRequerimos\r\n- Formación en Ciclo Formativo de Grado Superior de Desarrollo de aplicaciones multiplataforma.\r\n- Mínimo 1 año de experiencia en PL/SQL y se valorará conocimientos en C.\r\n- Deseable, no imprescindible, nivel medio de inglés (B1) para atender a nuestros clientes no españoles. Se valorará conocimiento de Italiano.\r\n- Horario de 9:00 a 18:00 horas. Pasado el periodo de formación inicial en la oficina, se podrá trabajar dos días por teletrabajo.', 1, '2022-02-14 23:38:36'),
(6042, 'Scopic', 'sales@scopicsoftware.com', 'https://www.jobatus.es/trabajo-remote-senior-web-developer-511071114', '4+ years of software development experience\r\nExtensive experince with full-stack development\r\nProficiency in one or more back-end languages/frameworks (e.g. PHP/Node.js/Python/C#/GoLang, Laravel/Django/Express/Koa)\r\nProficiency in JavaScript programming and one or more JS frameworks (e.g. React/Angular/Vue)\r\nStrong database design skills (SQL/NoSQL)\r\nExperience with one or more cloud providers (e.g. AWS/Google Cloud/Azure/Digital Ocean)\r\nExperience in using containers (e.g. Docker/LXD) and container orchestration (e.g. Kubernetes/ECS)\r\nSolid experience in system and software architecture\r\nExperience with web-oriented cross-platform mobile frameworks is a plus\r\nExperience in leading development teams is a plus\r\nGood written and spoken English\r\nStable internet connection and home computer\r\nBachelor\'s degree or higher', 1, '2022-02-15 14:07:47'),
(6043, 'Lomartov S.L.', 'info@lomartov.com', 'https://www.jobatus.es/trabajo-it-engineer-applications-developer-511474848', 'o Direct involvement in private contracts and European R&D Projects, with a strong innovative\r\ncomponent, when such activities require the advice of an expert in IT and computational systems. New ideas and innovative concepts coming from the IT Engineer & Applications Developer will be highly well accepted in order to develop new projects or products.', 1, '2022-02-15 14:21:59'),
(6044, 'Alicunde Systems', 'r.maquieira@alicunde.com', 'https://www.jobatus.es/trabajo-full-stack-developer-511629650', '5-8 years of experience in the delivery of best-in-class front-end code across a broad array of interactive web projects.\r\nMin. 4 year of experience with the below technologies is mandatory:\r\nPHP\r\nHTML\r\nJavaScript\r\nCSS', 1, '2022-02-15 14:32:02'),
(6045, 'Caravelo', 'talent@caravelo.com', 'https://www.jobatus.es/trabajo-intermediate-frontend-developer-512392512', 'You have at least 2 years of experience in frontend development positions.\r\nYou have a solid knowledge of JavaScript and OO programming (React/Vue.js as a plus), HTML + CSS + UX, REST APIs, git.\r\nYou\'re experienced with web components, adaptive design.\r\nYou have previous experience with SOLID principles, unit testing and integration tests.\r\nYou\'re experienced with project management software and issue tracking.\r\nYou have good written and verbal communication skills in English (it\'s our Company language!).\r\nYou can handle stressful situations.\r\nYou know how to work independently.', 1, '2022-02-15 14:36:21');
