(6048, 'Scopic', 'jobs@scopicsoftware.com', 'https://www.jobatus.es/trabajo-remote-intermediate-vuereact-developer-511418422', '3+ years of experience in software development\r\nStrong JavaScript skills, including ES6/ES7 and Typescript\r\n2+ year of experience working with Vue.js or React.js in commercial application(s)\r\nExperience developing reusable components and/or frontend libraries\r\nProficiency in using REST and/or GraphQL APIs\r\nGood HTML5/CSS3 skills\r\nSome back-end experience (with any technology) is required\r\nBack-end experience in particular with Node.js, C#/.Net or PHP is a plus\r\nBachelors degree or higher\r\nAt least intermediate level of written and spoken English', 1, '2022-02-15 14:46:14'),
(6049, 'Talent Search People', 'engineering@talentsearchpeople.com', 'https://www.jobatus.es/trabajo-fullstack-javascript-developer-511753368', '- You have studied Computer Science or equivalent professional experience.\r\n- You have at least 3 years of experience in Application Development using JavaScript (ES6).\r\n- You have at least 2 year of experience in the MERN Stack (MongoDB + Express + React + NodeJs).\r\n- You have knowledge of GIT Workflow and Web APIs.\r\n- You have professional experience in HTML and CSS / JSS.\r\n- You have ease with code testability and continuous integration / deployment.\r\n- You have a fluent level of English.\r\n- You are a person who is interested in new technologies and applications, who likes to work in a team, dynamic, proactive, independent and decisive.', 1, '2022-02-15 14:50:30'),
(6050, 'Rintral Trading Sl', 'marina.nebeus@gmail.com', 'https://www.jobatus.es/trabajo-javascript-developer-511754553', '- Develop new user-facing features\r\n\r\n- Build reusable code and libraries for future use\r\n\r\n- Ensure the technical feasibility of UI / UX designs\r\n\r\n- Optimize applications for maximum speed and scalability\r\n\r\n- Assure that all user input is validated before submitting to back-end services\r\n\r\n- Collaborate with other team members and stakeholders\r\n\r\nSkills and Qualifications:\r\n\r\n- Strong understanding of JavaScript, its quirks, and workarounds\r\n\r\n- Basic understanding of web markup, including HTML5 and CSS3\r\n\r\n- Good understanding of advanced JavaScript libraries and frameworks such as ReactJS, AngularJS.\r\n\r\n- Good understanding of asynchronous request handling, partial page updates, and AJAX\r\n\r\n- Proficient understanding of cross-browser compatibility issues and ways to work around such issues\r\n\r\n- Familiarity with JavaScript module loaders, such as Require.js and AMD\r\n\r\n- Familiarity with front-end build tools, such as Grunt and Gulp.js\r\n\r\n- Proficient understanding of code versioning tools, such as Git.\r\n\r\n- Good understanding of browser rendering behaviour and performance.\r\n\r\n-Preferably speak and write Russian, English and Spanish\r\n\r\nExperience with Zoho CRM is an added benefit.', 1, '2022-02-15 14:52:28'),
(6051, 'Cloudappi Sl', 'talento@cloudappi.net', 'https://www.jobatus.es/trabajo-fronted-developer-madrid-513487727', 'Responsabilidades\r\n\r\nDesarrollo en Vue.js, Angular/Angular2/ionic/react\r\n\r\nMadrid\r\n\r\nRequisitos del puesto\r\n\r\nRequisitos mínimos\r\n\r\nMódulo superior en informática o carrera en formación similar\r\n\r\n1 año en experiencia con desarrollos en Javascript\r\n\r\nExperiencia con Vue.js.\r\n\r\nDeseables\r\n\r\nExperiencia con Angular / Angular2 / React\r\n\r\nExperiencia en equipos SCRUM\r\n\r\nConocimientos de TDD\r\n\r\nConocimientos de definición y desarrollo de APIs\r\n\r\nOtros datos del puesto\r\n\r\nTrabajar duro, por algo que te gusta, se llama pasión/Si puedes soñarlo puedes {APIficarlo}¿Por qué trabajar con nosotros?\r\n\r\nSomos una empresa de innovación, por lo que nuestros proyectos suelen ser muy interesantes.\r\nLlevamos la innovación en el cuerpo, por lo que nos gusta implantar las herramientas más modernas.\r\nActualmente remoto, prepandemia modelo semipresencial, 2 días a la oficina + 3 remoto,valorable vuelta algún día al mes a partir de Enero 2022, sin confirmar', 1, '2022-02-15 14:57:54'),
(6052, 'Platanomelón', 'hola@platanomelon.com', 'https://www.tecnoempleo.com/data-engineer-barcelona/python-sql-r-google-cloud-platform/rf-6e5399c19nda2wad41m5', 'If you are willing to design our current data systems and build infrastructure from ground up, you are what we are looking for. The Data Engineer will support our data analysts and data scientists on data initiatives and will ensure optimal data delivery architecture is consistent throughout ongoing projects.\r\n\r\nWhat would your responsibilities be?\r\n\r\n* Design data collection and processing architectures for business units, and manage data and meta-data with\r\nproper structure of database management systems.\r\n* Develop, customize and manage integration tools for analytics usage, visualisation, and machine learning\r\nmodel deployment.\r\n* Provide data-access tools to view data, generate reports, and create visuals for analysts and data scientists.\r\n* Monitor the overall performance and stability of the system and use data to discover tasks that can be\r\nautomated.\r\n* Communicate with non technical stakeholders about projects in simple language\r\n\r\n\r\nWhat do we look for in you?\r\n\r\n* Background in computer science, engineering, mathematics or other quantitative fields\r\n* Experience in software development\r\n* Experience in large scale data modeling and ETL processes\r\n* Experience with a big data processing environment\r\n* Experience in cloud-based data processing platforms (GCP)\r\n* Knowledge of packaging and deploying applications in containerized environments\r\n* Experience in deploying and operationalise machine learning models\r\n* Fluency in English and Spanish', 1, '2022-02-15 15:25:41'),
(6053, 'IT Partner', 'recursos@itpartner.es', 'https://www.tecnoempleo.com/desarrollador-frontend-angular-valencia/angular-html5-css3-typescript-java/rf-398432aa3o37d00bc727', '\r\nRequisitos Mínimos:\r\n– Experiencia contrastada como desarrollador senior Frontend (Angular) (mínimo 3 años de experiencia)\r\n– Diseño e implantación de componentes y arquitecturas front: Uso de patrones SPA, PWA y orientación a Web Components\r\n– Tecnologías: Angular, HTML5, CSS3, Typescript, Javascript, Saas, REST, Open API, OAuth2, Webpack, Visual Studio Code, JSHint, Karma, Selenium\r\n– Metodologias: Agile, Scrum, DevOps, TDD/BDD', 1, '2022-02-15 15:39:09'),
(6054, 'Ibermatica', 'info@ibermatica.com', 'https://www.tecnoempleo.com/becarios-valencia-valencia/java-javascript/rf-4f89w4927xa50n21acxd', 'IBERMÁTICA es una empresa líder en TECNOLOGIA y CONOCIMIENTO. Apostamos por la satisfacción de nuestros clientes, crecemos con ellos y disfrutamos generando valor en los servicios TIC que ofrecemos. Creemos en las personas que hacen posible nuestro proyecto compartido, que aportan ilusión y quieren sumarse a él. Somos más de 3.000 personas comprometidas en la creación de soluciones tecnológicas en Finanzas, Administración Pública, Telco y Media, Industria y Servicios. Y tú...\r\n\r\n¿Quieres formar parte de nuestro proyecto?\r\n\r\nBuscamos 2 becarios con estudios superiores para nuestras oficinas de Valencia.\r\nRealizarán las siguientes funciones:\r\n\r\nDesarrollo de aplicaciones\r\nLenguajes orientado a objetos', 1, '2022-02-15 15:55:16'),
(6055, 'ICP Logística', 'calidad@icp.es', 'https://www.tecnoempleo.com/desarrollador-net-core-madrid/net-core-net-angular-sql-server-net-develope/rf-6b6f1a1494c67ebc80x5', 'ICP quiere contar con los mejores profesionales para Meco, por lo que invertimos en programas de formación continua específicos para el departamento IT. Gracias a ellos, nuestro equipo de desarrollo está siempre formado en la última tecnología y las últimas versiones de software y aplicaciones del mercado.\r\n', 1, '2022-02-15 16:01:23'),
(6056, 'UP7 Balear', 'info@up7b.net', 'https://www.tecnoempleo.com/tecnico-soporte-microinformatico-baleares/microinformatica-windows-ofimati/rf-d63eg7014jbc8k0b1cq9', '- Instalación y configuración de ordenadores, portátiles, tabletas y otros equipos.\r\n- Mantenimiento, instalación, configuración y gestión de cualquier equipamiento de tipo hardware.\r\n- Sustitución de piezas defectuosas o averiadas de todos y cada uno de los elementos que componen el parque microinformático.\r\n- Sustitución de equipamiento periférico obsoleto..\r\n- Instalación y configuración impresoras locales como en red.\r\n- Instalación y configuración de equipos multifunción.\r\n- Instalación y configuración de equipos de electrónica de red (routers, switch....).\r\n- Tareas básicas de reparación y mantenimientos.\r\n- Instalación, configuración y administración básica de servidores (sistema operativo, antivirus, copias de seguridad, etc.).', 1, '2022-02-15 16:13:27'),
(6057, 'VILAX', 'comunicacion@vilax.es', 'https://www.domestika.org/es/jobs/92219-full-stack-developer-viladecans-espana', '- Formación previa en Programación, Maquetación o Diseño web.\r\n- Experiencia con: lenguajes y frameworks de Frontend (HTML, CSS, PHP).\r\n- Implementación y desarrollo en WordPress.\r\n- Conocimientos de Elementor.\r\n- Nociones de Git.', 1, '2022-02-16 13:41:24'),
(6058, 'IOMarketing', 'rrhh@iomarketing.es', 'https://www.domestika.org/es/jobs/83921-disenador-a-web-madrid-espana', '- Conocimientos de Wordpress.\r\n- Conocimientos de compositores visuales de Wordpress tales como Elementor, Divi o similares.\r\n- Conocimientos de la Suite de Adobe: Photoshop, Ilustrator e Indesign.\r\n- Conocimientos en diseño y prototipado web con herramientas tales como Figma, Invision, Sketch, etc.\r\n- Conocimientos html y css.', 1, '2022-02-16 13:56:06'),
(6059, 'Agencia Fandom', 'tajo@agenciafandom.com', 'https://www.domestika.org/es/jobs/92111-disenador-a-web-alcala-de-henares-espana', '* Capacidad de gestionar un proyecto de desarrollo web en WordPress desde su concepción hasta su entrega a cliente.\r\n* Porfolio de webs realizadas por el/la candidato/a de forma demostrable.\r\n* Dominio de WordPress y WooCommerce: capacidad de realizar diseños y desarrollos a medida.\r\n* Valorable conocimiento de Prestashop, Magento y otros CMS.\r\n* Conocimientos avanzados de HTML5, CSS3, PHP y Javascript.\r\n* Valoramos muy positivamente conocimientos de cualquier otro lenguaje de programación.\r\n* Conocimientos y manejo de servidores: capacidad para contratar y gestionar planes de hosting, gestionar bases de datos, migrar entre entornos de producción y staging, copias de seguridad y despliegue de los CMS en los hosting propios o de cliente.\r\n* Conocimiento de programas de bocetaje y prototipado: Figma, Sketch, InVision, Adobe XD, similares...\r\n* Persona organizada y metódica.', 1, '2022-02-16 14:00:19'),
