(6067, 'alt120 comunicació intercativa s.l.', 'contact@alt120.com', 'https://www.domestika.org/es/jobs/52836-maquetador-a-front-web-barcelona-espana', 'Una persona que tenga conocimientos de:\r\n\r\n- Maquetación HTML5/CSS3\r\n- Muchas ganas de aprender.\r\n\r\nValoraremos:\r\n\r\n- Javascript y JS Frameworks (jQuery y similares)\r\n- WordPress\r\n- Maquetación de emailings.\r\n- Cierta sensibilidad con el diseño.\r\n- Less, SASS.\r\n- Conocimientos de frameworks como Foundation y Bootstrap.\r\n- Conocimiento y capacidad de desarrollo Responsive Design.\r\n- Desarrollo crossBrowser.\r\n- Sistemas de control de versiones (Git).\r\n- Capacidad de autogestión.', 1, '2022-02-17 23:28:09'),
(6068, 'NJUDEV WEB DEVELOPMENT SL.', 'info@njudev.de', 'https://www.infojobs.net/palma-de-mallorca/desarrollador-laravel-framework-php/of-if24d98c192477e9dea2d306fb5cf88?applicationOrigin=search-new%7Celement%7E43631036240&amp;searchId=43631036240&amp;page=1&amp;sortBy=RELEVANCE', 'Descripción:\r\n Njudev Web-development SL es una empresa Internacional, dedicada al Diseño, la Creación y el Desarrollo de las Aplicaciones web. Trabajamos sobre todo con el mercado Aleman, Ingles y Español.\r\n Nos encontramos en un proceso de expansión y crecimiento, por ello, buscamos un Desarrollador/a especialista en Laravel Framework / PHP para un nuevo proyecto para la oficina de Palma de Mallorca (centro). El candidato tendrá 4 programadores de otros países a su cargo, la comunicación con los cuales se mantendrá online en Ingles. La integración se planea a partir de 1 de abril.', 1, '2022-02-18 00:01:22'),
(6069, 'Góbalo', 'administracion@gobalo.es', 'https://www.domestika.org/es/jobs/92323-full-stack-developer-en-remoto', '* Experiencia, de mínimo 3 años, como Full Stack Developer que sepa desenvolverse tanto en Front-End como en Back-End.\r\n* Front-End:\r\n\r\nAmplio conocimiento de Javascript, con uso de frameworks como jQuery, AngularJS, etc.\r\nExperiencia con HTML, CSS3 y responsive.\r\nExperiencia en el uso de frameworks CSS como Bootstrap.\r\nExperiencia en desarrollo orientado a SEO.\r\n\r\n* Back-End:\r\n\r\nSólidos conocimientos en MVC y POO.\r\nSólidos conocimientos y experiencia demostrable programando en PHP con frameworks como Laravel (valorable otros frameworks).\r\nExperiencia demostrable, a nivel desarrollo, en WordPress (valorable Drupal, Prestashop, etc.)\r\nConocimientos de API REST, tanto para servir datos, como consumirlos de otros servicios o aplicaciones.\r\nExperiencia en entornos Cloud, preferiblemente Google AppEngine, aunque se valorará haber trabajado con Heroku, Azure, AWS...\r\nExperiencia en bases de datos SQL (MySQL)\r\nConocimientos en seguridad informática orientada al desarrollo web, XSS e inyección SQL.\r\n\r\n* Experiencia en uso de control de versiones GIT o similares.\r\n\r\n* Nivel alto de inglés.\r\n* Dotes comunicativas.\r\n\r\nen asuntos para mandar el cv, pone: “CV Full Stack Developer”', 1, '2022-02-21 14:46:36'),
(6070, 'dayvosistemassl', 'info@dayvo.com', 'https://www.infojobs.net/leon/desarrollador-php-wordpress-prestashop/of-i2b0dad6f124558b00fb3263935e119?applicationOrigin=search-new%7Celement%7E43667920820&amp;searchId=43667920820&amp;page=1&amp;sortBy=RELEVANCE', 'Requisitos mínimos\r\nProgramación PHP\r\nManejo de plataformas Prestashop, Wordpress y plataformas e-commerce\r\nExperiencia demostrable en creación e implementación de módulos y pluggins.\r\nConocimiento y uso de LSSI\r\nCapacidad de crear estructuras web contenido.\r\nAltas capacidades comunicativas con clientes.', 1, '2022-02-21 16:00:52'),
(6071, 'Mytic Innova', 'info@mytic.es', 'https://www.tecnoempleo.com/qa-tester-barcelona/mysql-java-jmeter-postman-junit-selenium-jasmine/rf-2adcw79818d71ub5d56f', 'SE REQUIERE CONOCIMIENTO DE:\r\n• MySQL\r\n• Java\r\n• JMeter\r\n• Postman\r\n• JUnit\r\n• Selenium\r\n• Jasmine\r\n\r\nHABILIDADES Y COMPETENCIAS REQUERIDAS\r\n• Experiencia mínima de 1 año.\r\n• Orientación al cliente\r\n• Trabajo en equipo.\r\n• Capacidad de adaptación y flexibilidad.\r\n• Alta capacidad de organización.', 1, '2022-02-22 13:36:01'),
(6072, 'INVOIN', 'rrhh@invoin.com', 'https://www.tecnoempleo.com/desarrollador-net-core-100-remoto-100-en-remoto/net-core-docker-azure/rf-c6c9bc6edbdb0d2802c6', 'En Grupo INVOIN estamos buscando Desarrolladores .Net para un interesante proyecto estable del sector de las finanzas en Valencia con Teletrabajo 100%.\r\n\r\nSe precisan al menos 2 años de experiencia en:\r\n\r\n- Web API REST con ASP.NET Core >=v3.1\r\n- Lenguaje programación C#\r\n- Microservicios en .Net Core\r\n- ORM con Entity Framework Core\r\n-Cache Redis u otros sistemas de cache\r\n- Bases de datos NoSQL como MongoDB u otros, y relacionales MS SQL Server\r\n- Desarrollo en la nube Microsoft Azure, AWS o Google Cloud\r\n- Contenerización de APIs con Docker\r\n- ETLs con alguna herramienta de integración comercial u open source (SQL Server Integration Services,\r\nTalend, Pentaho)\r\n- Lenguaje de programación: SQL', 1, '2022-02-22 13:38:47'),
(6073, 'Incoming Domain', 'rrhh@incomingdomain.com', 'https://www.tecnoempleo.com/a-testing-automation-con-ingles-barcelona/testing-html5-css3-sql/rf-41b47d3f539f222af1j4', 'TELETRABAJO para Desarrolladores (AF, AT, AP, PS) en alguno de los siguientes entornos\r\n\r\nOFERTAS ACTIVAS:\r\n\r\nBACKEND SERVICES , CORE BANKING , INSURANCE , DATABASE , MICROSOFT , TESTING\r\n\r\nDWH / ETL . . : INFORMATICA, PL-SQL\r\nFrontEnd. . . . : HTML5, HTML, CSS3,APPVERSE, QWT, JAVA SCRIPT , REACT\r\nBackEnd. . . . : Indispensable APIs, Spring MVC, API, Maven, GIT, JIRA,\r\n. . . . . . . . . . . . : Docker, Kubernetes, Openshift, JUnit, Nexus, SonarQ,\r\n. . . . . . . . . . . . : Spring Data, Swagger, Agile\r\nJAVA. . . . . . . : J2EE, J2SE,SCRIPT,(SHELL,PYTHON,PERL)\r\n. . . . . . . . . . . . : MICROSERVICIOS\r\n. . . . . . . . . . . . : (SVN,GIT) (API Rest,RAML,Springboot,)\r\n. . . . . . . . . . . . : (JIRA,REMEDY,GITLAB)\r\nHOST . . . . . . : COBOL, CICS,, DB2\r\nMicrosoft . . . : .NET, C#, VISUAL BASIC ANGULAR , SQL SERVER\r\nMobility. . . . . : IOS, ANDROID\r\nOther . . . . . . : C/C++,VISUAL BASIC\r\nTesting . . . . . : QA, SCRUM,AUTOMATION, MANUAL...\r\nDBA . . . . . . . : LINUX,DOCKER,KUBERNETES,JENKINS,ANSIBLE\r\n. . . . . . . . . . . .: (MAVEN,GRADLE)(JUNIT,KARMA,JASMINE)\r\n. . . . . . . . . . . . : (PYTHON,JAVA,GROOVY)\r\n. . . . . . . . . . . . : (ADMINISTRACION DE REDES)\r\nDATABASE . . . : SQL Server, ETLs,DTSX, VISUAL BASIC , . NET\r\n\r\nOtros detalles de la oferta', 1, '2022-02-22 13:52:25'),
(6074, 'Housell', 'jobs@housell.com', 'https://www.domestika.org/es/jobs/92365-desarrollador-php-en-remoto', '¿Qué harás?\r\nProgramar funcionalidades PHP usando MVC y OOP.\r\nCrear APIs para acceso a datos y transaccionales.\r\nModelar datos usando BBDD relacionales (MySQL).\r\n\r\n¿Qué buscamos?\r\n+2 años de experiencia en desarrollo PHP (frameworks tipo Symfony).\r\nConocimiento de estructuras de datos y modelado para MySQL.\r\nExperiencia en optimización del performance de aplicaciones web.\r\nPersona proactiva, flexible, acostumbrada a trabajar en empresas muy dinámicas.\r\nTeam player, espíritu motivador y actitud positiva.', 1, '2022-02-22 14:32:31'),
(6075, 'TPF GETINSA EUROESTUDIOS, S.L.', 'info@tpfingenieria.com', 'https://www.infojobs.net/madrid/desarrollad-r-full-stack-php-c/of-i7b5cb20bf243b0948ed9f4f698ef75?applicationOrigin=search-new%7Celement%7E43631036240&amp;searchId=43631036240&amp;page=1&amp;sortBy=RELEVANCE', 'DESARROLLADOR/A FULL STACK EN PHP Y C#\r\nProgramación en C#\r\nProgramación en PHP\r\nBases de datos SQL: SQL Server, MySQL\r\nHTML5, CSS3, JavaScript, JQuery\r\n\r\nDESARROLLADOR/A FULL STACK .NET\r\nProgramación en C# y Visual Basic .NET\r\nSQL Server\r\nHTML5, CSS3, JavaScript\r\n\r\nRequisitos deseados', 1, '2022-02-22 14:45:01'),
(6076, 'Somos Experiences - Unit Elements', 'developer@unitelements.com', 'https://www.domestika.org/es/jobs/92538-desarrollador-full-stack-madrid-espana', '¿Qué requisitos deberás tener?\r\n-Formación en Ingeniería, Grado o Ingeniería técnica en informática o telecomunicaciones.\r\n-Experiencia de más de 3 años en programación PHP, Node, ...\r\n-Se valorará experiencia en Laravel / Symfony.\r\n-Conocimientos entornos AWS y contenedores (Docker, Kubernetes, ...)\r\n-Alta capacidad de organización y trabajo.', 1, '2022-02-28 13:21:48'),
(6077, 'GENTALIA SL.', 'rrhh@gentalia.es', 'https://www.infojobs.net/madrid/front-end-developer/of-i1f996094f74e4a807a9b4c110dd225?applicationOrigin=search-new%7Celement%7E43667920820&amp;searchId=43667920820&amp;page=1&amp;sortBy=RELEVANCE', 'Se valorará:\r\n- Incorporación inmediata (no superior a 15 días naturales).\r\n- Conocimientos en plataformas eCommerce.\r\n- Conocimientos aplicaciones móviles.\r\n- Conocimientos de FrameWorks de desarrollo (Grails, Spring, Hibernate,..).\r\n- Metodologías Agiles.\r\n- Manejo de herramientas de analítica Web\r\n- Experiencia en configuración y desarrollo en WordPress\r\n- Experiencia integrando publicidad (Creatividades, Integración de GAM y Prebid.js, etc.).\r\n- Buen Nivel de inglés.\r\n- - Ganas de aprender.', 1, '2022-02-28 13:36:45'),
