(6080, 'Vicky Foods', 'recursos.humanos@vickyfoods.es', 'https://www.tecnoempleo.com/programador-web-dispositivos-moviles-valencia/php-javascript-postgresql-my/rf-18fb8f9b70c3em6230b7', '- Programación en PHP y/o Javascript.\r\n- Bases de datos PostgreSQL, MySQL.\r\n- Herramientas de control de versiones.\r\n\r\nVALORABLE:\r\n- Programación en Ajax, JQuery, Sencha, CSS, HTML5 y Webservices.\r\n- Bases de datos no relacionales MongoDB.\r\n- Desarrollo en entornos lowcode & no-code con ecosistema Microsoft Power Platform.\r\n- Uso de Herramientas de reporting PowerBI y/o Cognos.\r\n- Desarrollo de aplicaciones para dispositivos Android e iOS con .Net Xamarin.\r\n- Programación orientada a objetos.\r\n- Avanzado nivel de inglés y/o francés.', 1, '2022-03-02 13:21:05'),
