(6082, 'Factoria Creativa', 'rrhh@factoriacreativa.net', 'https://www.domestika.org/es/jobs/92289-programador-a-web-barcelona-espana', 'Profesional con dos años mínimo de experiencia en proyectos web implementando Wordpress, Woocommerce\r\nExperto en Elementor y Bootstrap.\r\nConsumo y desarrollo de APIs Rest\r\nCuidado por los detalles en el desarrollo mobile y desktop multidispositivo.\r\nConocimientos PHP y Javascript para modificar o programar pequeñas cuestiones que necesite personalizar el cliente.\r\nCreación de landing pages.\r\nValorable conocimiento de herramientas de prototipado.\r\nPerfil eficiente, eficaz, pro-activo y muy responsable con el trabajo. Trabajamos por objetivos, orientados a resultados. Se valora profesionales que cuenten con proyectos personales, y se estén formando de forma continuada. Así como que la programación sea vocacional, mejora continua y curiosidad.', 1, '2022-03-03 13:29:33'),
(6083, 'BOTECH FPI', 'info@botechfpi.com', 'https://www.infojobs.net/tres-cantos/desarrollo-wordpress/of-i9a52a82f494e5e93b91e8c3807eade?applicationOrigin=search-new%7Celement%7E43667920820&amp;searchId=43667920820&amp;page=1&amp;sortBy=RELEVANCE', 'Experiencia de al menos 1 año en WordPress (montaje, pluggins, servicios, controllers, manejo de caché...).\r\nExperiencia con Drupal en Backend.\r\nConocimientos de Git y buenas prácticas.\r\nConocimientos de HTML, JavaScript, jQuery.\r\nConocimientos ACF PRO (Campos personalizados avanzados).\r\nConocimientos con la API de Wordpress.', 1, '2022-03-03 13:56:30'),
(6084, 'Silicon HR', 'arantxa.cortes@siliconhr.com', 'https://www.infojobs.net/madrid/web-project-manager/of-ib28e568316422ca3a3d8c059a42b60?applicationOrigin=search-new%7Celement%7E43667920820&amp;searchId=43667920820&amp;page=2&amp;sortBy=RELEVANCE', 'Skills/Qualifications:\r\n· University Degree, Marketing preferred\r\n· Marketing-oriented as well as technical mindset\r\n· 3-6 years experience in Web Project Management compulsory (no more than 7)\r\n· Good working knowledge of digital marketing best practices\r\n· CMS integration experience compulsory, WordPress specifically a plus\r\n· End-user and data-driven orientation\r\n· Fluent in English & Spanish\r\n· Problem solving and organizational skills\r\n· Excellent customer and team management skills\r\n· Ability to be efficient and productive under pressure\r\n· Good verbal & written communication skills\r\n· Proactivity\r\nAbove all, you must be keen and motivated! You will enjoy a nice work environment, if you are willing to have fun while working and are able to work with an international team.', 1, '2022-03-03 14:15:03'),
(6085, 'ElixTech', 'empleo@elixregtech.com', 'https://www.domestika.org/es/jobs/92706-programador-a-junior-madrid-espana', '¿Qué buscamos?\r\nBuscamos un Programador/a Junior para nuestro equipo de tecnología. Si eres una persona proactiva, a la que le gusten los retos, que tenga ganas de aprender y se sienta cómoda trabajando en equipo, sigue leyendo, ¡Esto te interesa!\r\n\r\nLo que consideramos imprescindible:\r\n• Conocimiento en Framework Laravel de PHP.\r\n• Conocimiento en Javascript.\r\n• Conocimiento en trabajar con BBDD (MySQL).\r\n\r\nNo exigible, pero muy valorable (de más importante a menos):\r\n• Conocimiento en despliegue de software a través de GIT.\r\n• Conocimiento o uso residual de metodología Agile (Scrum).\r\n• Conocimiento o uso residual de metodología Kanban (JIRA).', 1, '2022-03-04 18:50:27'),
(6086, 'GRUPO CIE, S.L.', 'info@grupocie.com', 'https://www.infojobs.net/altea/desarrollador-programador-aplicaciones-con-conocimientos-delphi-sql-php/of-i32509ac72841ba96a637486b3eda1c?applicationOrigin=search-new%7Celement%7E43631036240&amp;searchId=43631036240&amp;page=1&amp;sortBy=RELEVANCE', 'Formar parte de un equipo de Consultores especializados para analizar, programar y desarrollar soluciones tecnológicas para empresas de ámbito nacional.\r\n\r\n', 1, '2022-03-04 19:01:23'),
(6087, 'Keedio', 'info@keedio.com', 'https://www.infojobs.net/villanueva-de-la-canada/analista-progamador-backend-pl-sql/of-id3d178ad5e42c99f2153d8d2dbbecf?applicationOrigin=search-new%7Celement%7E43631036240&amp;searchId=43631036240&amp;page=1&amp;sortBy=RELEVANCE', 'Por encargo de la Universidad Alfonso X, estamos a la búsqueda de un Analista Programador Backend con conocimientos de PL/SQL\r\n\r\nEl puesto tiene como misión de Analizar y programar proyectos sobre tecnologías ORACLE / PL SQL y arquitecturas BI.', 1, '2022-03-04 19:07:44'),
(6088, 'Applinet', 'rrhh@applinet.es', 'https://www.domestika.org/es/jobs/92755-programador-web-en-remoto', 'Conocimientos técnicos necesarios:\r\n• Programación con PHP, HTML, JavaScript, bootstrap, etc.\r\n• Conocimientos en framework Laravel (desarrollo de nuevos proyectos)\r\n• Conocimientos en framework Codeigniter (correctivo desarrollos actuales)', 1, '2022-03-07 14:32:13'),
(6089, 'Arimetrics', 'rrhh@arimetrics.com', 'https://www.domestika.org/es/jobs/92768-desarrollador-web-frontend-en-remoto', 'Conocimientos Necesarios:\r\n- HTML, CSS, PHP, JavaScript y jQuery\r\n- Experiencia en base de datos MySQL\r\n- Dominio de Wordpress y Prestashop\r\n- Creación de plantillas personalizadas en Wordpress\r\n- Migraciones de CMS', 1, '2022-03-07 14:34:24'),
(6090, 'Better', 'rr.hh@betterconsultants.es', 'https://www.infojobs.net/madrid/senior-front-end-developer-javascript-nativo/of-i22772b9cee469387f9084476c91072?applicationOrigin=search-new%7Celement%7E43630715860&amp;searchId=43630715860&amp;page=1&amp;sortBy=RELEVANCE', 'BETTER CONSULTANTS, PRESTIGIOSA FIRMA DE CONSULTORIA NACIONAL dedicada al diseño e implantación de proyectos tecnológicos y organizativos a medida para las principales empresas y organizaciones públicas y privadas del país con 30 años de experiencia, precisa incorporar CONSULTORES/INGENIEROS DE DESARROLLO javascript nativo para proyectos desde Madrid o en teletrabajo.\r\n\r\nBuscamos profesionales para LIDERAR importantes soluciones de negocio con nuevos desarrollos.\r\n\r\nSE OFRECE:\r\n\r\n-ORGANIZACIÓN EN CONSTANTE CRECIMIENTO.\r\n\r\n- POSIBILIDAD REAL DE DESARROLLAR CARRERA PROFESIONAL.\r\n\r\n-GRAN ESTABILIDAD PROFESIONAL Y PROYECTOS DE VALOR AÑADIDO.\r\n\r\n- FORMACION\r\n\r\n- EXCELENTE AMBIENTE DE TRABAJO EN EQUIPOS ALTAMENTE CUALIFICADOS.\r\n\r\n-HORARIO FLEXIBLE.\r\n\r\n- SALARIOS COMPETITIVOS EN FUNCION DE LOS VALORES APORTADOS.', 1, '2022-03-07 14:48:56');
